values ('CC-Z-01', '2935', 'Virtualized data centers', '600', '9', '2', '2023', 'македонски или англиски', 'Планирање и развој на податочен центар. Скалабилност и еластичност.
Архитектури и технологии на следна генерација (модерни) податочни центри.
Стратегија на ИТ во големи компании (Enterprise) со можност за скалирање на милиони корисници.
Виртуелизација на сервери и складишта. Еволуција на второ ниво. Консолидација на В/И.
Сегментација на инфраструктура.
Виртуелен податочен центар и пресметување во облак. Концепти на приватен облак. Инфраструктура
како сервис (IaaS). Креирање типови на виртуелни машини. Виртуелизација и заштита на мрежа.
Планирање и развој на приватен облак со отворен код. Архитектура на приватен облак.
Администрација на приватен облак. Заштита на приватен облак. Овозможување на архитектура за
платформа како сервис', 'Planning and developing a data center. Scalability and elasticity.
Next -generation (modern) data centers architectures and technologies.
IT strategy in large companies (Enterprise) with the possibility of scaling millions of users.
Virtualization of servers and repositories. Evolution on a second level. Consolidation of C/s.
Infrastructure segmentation.
Virtual data center and cloud calculation. Concepts of a private cloud. Infrastructure
as a service (IAAS). Creating types of virtual machines. Virtualization and network protection.
Planning and developing an open source private cloud. Architecture of a private cloud.
Administration of a private cloud. Protecting a private cloud. Enabling architecture for
platform as a service',
        'Овој предмет ќе го оспособи студентот за планирање и развој на виртуелизиран податочен центар, распределба на ресурси, опфаќајќи ги притоа виртуелизација на пресметковни, мрежни и влезно/излезни ресурси со развој на приватен облак.',
        'This course will be trained by the student for planning and developing a virtualized data center, the distribution of resources, covering the virtualization of computational, network and input/output resources with the development of a private cloud.',
        'Предавања, вежби, самостојна работа, проектни задачи, семинарски работи', 'интерна евалуација и анкети',
        'NULL', 'реализирани 15.1 и 15.2', '45', '15', '30', '50', '40', '180', '0', '50', '0', '0'),
       ('CC-Z-02', '2949', 'Scalability for SaaS applications', '600', '9', '2', '2023', 'македонски или англиски', 'Сервисно ориентирана архитектура. Вовед во SaaS. Премин од сервиси и апликации во SaaS.
Архитектура на SaaS апликации. Костур на SaaS на серверска страна. Алатки за развој на SaaS.
Дизајнирање на SaaS. Наоѓање на грешки. SaaS на клиентска страна. Aгилен развој на SaaS.
Behavior-Driven Design. Развој поттикнат од тестирање. Одржување. Менаџирање. Шаблони за SaaS класи.
Надежност и безбедност на SaaS апликации. Перспективи на SaaS.', 'Service oriented architecture. Introduction to Saas. Transfer from services and applications to Saas.
Architecture of Saas applications. Saas skeleton on the server side. SAAS development tools.
Designing Saas. Finding mistakes. Saas on the client side. Agile development of SAAS.
Behavior-Driven Design. Development driven by testing. Maintenance. Management. Templates for Saas Classes.
SAAS Applications`s Reliability and Security. SAAS perspectives.',
        'Овој курс ќе ги подготви студентите за концептот на софтвер како сервис (SaaS), негов развој, имплементација, како и барања, тестирање, управување и одржување. Особен осврт ќе се даде на скалабилноста на софтверот и повеќестанарство (multi-tenancy)',
        'This course will prepare students for the concept of software as service (SAAS), its development, implementation, as well as requirements, testing, management and maintenance. Particular review will be given to software scalab and multi-stationary (multi-tenancy)',
        'Предавања, вежби, самостојна работа, проектни задачи, семинарски работи',
        'интерна евалуација и анкети, според модел образложен претходно', 'NULL', 'реализирани 15.1 и 15.2', '45', '15',
        '30', '50', '40', '180', '0', '50', '0', '0'),
       ('CC-Z-03', '2940', 'Security challenges in virtual environments', '600', '9', '2', '2023',
        'македонски и англиски',
        'Основни стандарди / најдобри пракси / упатства за безбедност на информациски системи (ISO 27000 серија на стандарди, NIST серија на стандарди, SAS70 (и произлезените од него), COBIT, HIPAA, PCI/DSS). Стандардизација на безбедност во облак (CSA, ENISA, NIST). Усогласеност на генералните стандарди за безбедност со безбедност на облак. Нови безбедносни ризици кај пресметување во облак, заштита и приватност на податоци, безбедносни ризици и придобивки при миграција на услуги во облак, континуитет на бизнис на деловни информациски системи во облак, евалуација на безбедност на различни нивоа во облакот, на системите за облак, на добавувачите на услуги во облак. Управување со безбедносните ризици во облак.',
        'Basic Standards / Best Practices / Information System Safety Instructions (ISO 27000 Series of Standards, NIST SERIES OF STANDARDS, SAS70 (and Costed by it), COBIT, HIPAA, PCI / DSS). Cloud safety standardization (CSA, ENISA, NIST). Compliance with general cloud safety standards. New security risks in cloud calculation, data protection and privacy, security risks and benefits of cloud service migration, continuity of business information systems in cloud, evaluation of different cloud security, cloud systems, Cloud service providers. Managing security risks in the cloud.',
        'Курсот се фокусира на предизвиците на обезбедување на информациските системи и податоци кои се обработуваат и чуваат во облакот, како и на основните безбедносни аспекти на виртуелизираните околини.',
        'The course focuses on the challenges of providing information systems and data that are processed and stored in the cloud, as well as the basic security aspects of virtualized environments.',
        'Предавања, вежби, самостојна работа, проектни задачи, семинарски работи',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '45', '15', '30', '50', '40',
        '180', '45', '50', '0', '10'),
       ('CC-Z-04', '2960', 'Advanced cloud computing topics', '600', '10', '2', '2023', 'македонски или англиски', 'Преглед на напредни теми за пресметување во облак и сервисно пресметување за различни домени, како serverless пресметување, edge пресметување. роботика во облак, анализа на големи податоци, индустрија 4.0, итн.
Напредни алгоритми и како се употребуваат во реални сценарија. Примери се за висока достапност, раздвојување податоци, географско балансирање на оптоварување со повеќе облаци, автоматско откривање и формирање на групи на контејнери, интеракции помеѓу IoT и облак, итн.
Aлгоритми за контрола на еластичноста во пресметување во облак, IoT, и магла и како се користат во реални сценарија. Примери за еластичност во добро познати системи во облак, алгоритми за еластична координација во повеќе облачни околини, алгоритми на еластичност за магла и NFV, итн.
Техники и алатки за следење/мониторирање на облак, IoT, облак и системи за магла. Примери се следење на перформансите за преглед од крај до крај, техники на инструментација за облак и IoT.', 'Overview of Advanced Cloud Calculation Topics and Service Calculation for Different Domains, such as Serverless Calculation, EDGE Calculation. Cloud robotics, large data analysis, industry 4.0, etc.
Advanced algorithms and how they are used in real scenarios. Examples are for high availability, data separation, geographical balance of multiple cloud loads, automatic detection and formation of container groups, interactions between IoT and Cloud, etc.
Algorithms to control elasticity in cloud, IoT, and fog and how they are used in real scenarios. Examples of elasticity in well -known cloud systems, elastic coordination algorithms in many clouds, fog and NFV elasticity algorithms, etc.
Techniques and tools for tracking/monitoring of cloud, IoT, cloud and fog systems. Examples are the monitoring of end -to -end review performance, cloud and IoT instrumentation techniques.',
        'Овој курс ги претставува и проучува актуелните теми во пресметување во облак како примена на serverless пресметување, напредни алгоритми, модели на системи и техники за следење и анализа на перформансите за врвни услуги во облак, системи за софтверски услуги, IoT и edge пресметување,  комплексни и хибридни системи за пресметување во облак, како што се IoT системи и федерации во облак како континуирано компјутерско опкружување каде што ќе се развиваат и извршуваат сложени апликации.',
        'This course represents and studies current topics in cloud calculation as applying serverless calculation, advanced algorithms, system models and techniques for monitoring and analyzing top -notch cloud services, software systems, IoT and EDGE calculation, complex and complex and complex Cloud hybrid systems such as IoT systems and federations in the cloud as a continuous computer environment where complex applications will develop and execute.',
        'Предавања, вежби, самостојна работа, проектни задачи, семинарски работи',
        'интерна евалуација и анкети, според модел образложен претходно', 'NULL', 'реализирани активности 15.1 и 15.2',
        '40', '30', '20', '60', '30', '180', '0', '60', '0', '0'),
       ('DCS-I-05', '1725', 'Coding theory and applications', '600', '9', '2', '2023', 'Македонски и англиски', '- Вовед во кодови кои поправаат грешки и нивна примена.
- Линеарните кодови. Кодирање и декодирање кај линеарнитe кодови.
