- Кодови на Рид-Милер и кодови на Рид-Соломон.
- Кодови што откриваат грешки и CRC кодови.', '- Introduction to codes that correct errors and their application.
- linear codes. Coding and decoding in linear codes.
- Hamingon codes. Cyclic codes.
-Codes of Reed Miller and Codes of Reed-Solomon.
- Codes that detect errors and CRC codes.', 'Главна цел на теоријата на кодирање е пронаоѓање на кодови кои обезбедуваат брз и
коректен пренос низ канал со шум. Различни кодови се оптимални во различни
примени. Целта на курсот е запознавање со основните кодови кои откриваат и
поправаат грешки и нивната практична примена.', 'The main purpose of coding theory is to find codes that provide fast and
Correct transmission through the channel with noise. Different codes are optimal in different
received. The purpose of the course is to know the basic codes that reveal and
Fix errors and their practical application.', 'Предавања, проекти, дискусии, работилници',
        'Механизам за интерна евалуација и анкети', 'NULL', 'Реализирани активности 15, 16', '60', '', '45', '45', '30',
        '180', '0', '45', '50', '0'),
       ('DCS-I-06', '635', 'Multimedia and scalable web', '600', '9', '2', '2023', 'македонски и англиски', 'Употребата на мултимедијални содржини во веб продукти вклучувајќи стандарди и технологии. Употреба на различни мултимедијални технологии, комбинации од мултимедијални технологии. Дизајнирање на мултимедијален веб, медиуми за стриминг, напредно скриптирање за мултимедијални содржини, тестирање мултимедијални веб апликации, достапност на веб, мобилни мултимедијални апликации, HTML 5 Canvas, JavaScript. Оптимизација за пребарувачи - SEO
Мултимедијални веб апликации за мобилни уреди како мобилни телефони и падови, но и големи екрани, телевизори. Развој на игри, дизајн, мобилни прегледувачи, категории на мултимедијални содржини. Скалабилен веб дизајн.
Безбеден веб развој (принципи, справување со грешки, автентикација, авторизација, евиденција, IO валидација, управување со сесии), (XSS, SQL Injection, CSRF, Clickjacking, DoS, DT, FI, CI)', 'The use of multimedia content in web products including standards and technologies. Use of various multimedia technologies, combinations of multimedia technologies. Designing multimedia web, streaming media, advanced multimedia content scripting, multimedia web applications, web availability, mobile multimedia applications, HTML 5 Canvas, JavaScript. SEO Search Engines - SEO
Multimedia web applications for mobile devices such as mobile phones and downs, but also large screens, TVs. Development of games, design, mobile viewers, categories of multimedia content. Scalable web design.
Safe Web Development (Principles, Error Management, Authentication, Authorization, Record, IO Validation, Sessions Management), (XSS, SQL Injection, CSRF, ClickJacking, DOS, DT, FI, CI)', 'По комплетирање на курсот кандидатите се очекува студентите за знаат да развиваат веб страници со современ дизајн, вклучувајќи структура, архитектура, компатибилност со различни уреди, употреба на каскадни стилови, употребливост, скалабилност со различен број корисници, оптимизација за пребарувачи, итн.
Се очекува канидатите да
1. Демонстрираат напредно разбирање на важноста на добар дизајн, интеракција и употребливост на веб страниците на различни платформи и уреди.
2. Демонстрираат практично знаење за дизајн и употребливост и да можат да го применат знаењето при дизајнирање на ефективни мултимедијални веб сајтови.
3. Да комуницираат со терминологија специфична за оваа област.
4. Критички да евалуираат примери на дизајн и интерактивност на веб сајтови, вклучувајќи и проценка на свои производи.
5. Да демонстрираат свесност за стратегии врзани со разбирање на потребите на корисниците на веб мултимедијални продукти.', 'After completing the course, candidates are expected to know how to develop contemporary design websites, including structure, architecture, compatibility with different devices, cascading styles, usability, scalability with different number of users, search engine optimization, etc.
CANIDATES are expected to
1. Demonstrate an advanced understanding of the importance of good design, interaction and usability of web pages on different platforms and devices.
2. Demonstrate practical knowledge of design and usability and be able to apply knowledge when designing effective multimedia websites.
3. To communicate with the terminology specific to this area.
