       ('del_m23_w_064', '2926', 'Advanced Management Information Systems', '600', '9', '2', '2023',
        'македонски, англиски', 'Теми обработени во рамките на овој предмет:
- Вовед во областа информациски системи. Телото на знаење и системот на компетенции во областа информациски системи.
- Историјат на развојот на областа информациските системи.
- Управување со организации со помош на објективни показатели, аналитики и воспоставени знаења. Важноста на управувањето со податоци и информации.
- Информациски системи – како комплекс од луѓе, технологии и организациски шеми.
- Готови информациски системи – карактеристични видови готови информациски системи во типична организациска поставеност.
- Развој на сопствени решенија за информациски системи. Методологии на развој.
- Технологии за развој и модерни архитектури на информациски системи
- Управување со проектите за развој на информациските системи и со животниот циклус на информациските системи.
- Животен циклус – конципирање на информациски системи, типични фази на развој - од концепт до модел, од модел до архитектура, од архитектура до реализација, од релизација до имплементација, од имплементација до транзиција.
- Оценување на квалитет кај информациски системи. Одржување квалитет во животниот циклус на информациските системи.
- Етички дилеми кај информациските системи.
- Истражувања и развој на науката во областа информациски системи.', 'Topics processed within this subject:
- Introduction to the field information systems. The body of knowledge and the system of competencies in the field of information systems.
- History of the development of the field information systems.
- Management of organizations with the help of objective indicators, analytics and established knowledge. The importance of data management and information.
- Information systems - as a complex of people, technologies and organizational schemes.
- ready -made information systems - characteristic types of ready -made information systems in typical organizational setup.
- Development of own solutions for information systems. Development methodologies.
- Development technologies and modern architectures of information systems
- Managing project development projects and the life cycle of information systems.
- Life cycle - conceptual information systems, typical stages of development - from concept to model, from model to architecture, from architecture to realization, from relation to implementation, from implementation to transition.
- Assessment of quality in information systems. Maintain quality in the life cycle of information systems.
- Ethical dilemmas in information systems.
- Research and development of science in the field of information systems.', 'Управувањето со податоците во една организација и нивното користење за извлекување објективни информации за состојбата во која се наоѓа организацијата и за можните правци и начини на нејзино идно делување на кратки и долги временски периоди е неопходната основа на паметното работење кај современите организации. Интегрираните информациските системи како решенија на ниво на цела организација се носечки столб во ваквото унапредување на организациите. Целта на курсот е студентот да се запознае со информациските системи и да се фокусира на клучните аспекти во овозможувањето решенија базирани на интегрирани информациски системи – од начинот на нивно конципирање, организацијата на животниот циклус, развојот, пуштањето во употреба, до згаснувањето и транзиција кон нови решенија.

Компетенции кои се очекува да ги стекне студентот по завршувањето со предметот:
- Да ја разбира важноста на воведувањето информациски системи за управување кај иновативните организации, компании и институции во различни сфери
- Да знае да примени готови платформи за градење на информациски системи и да ги мапира типичните функционалности на готовите платформи, наспроти реалните побарувања на корисниците
- Да знае да употреби современи методологии за организација на процесот на развој на информациски системи
- Да може да управува со проекти кои го покриваат целиот животен циклус на развој на информациски систем на ниво на цела органиација
- Да може аргументирано да ги анализира и критикува на минати проекти за развој на информациски системи и готови системи кои се во употреба', 'Data management in an organization and their use to extract objective information on the situation in which the organization is located and the possible directions and ways of its future action for short and long periods of time is the necessary basis of smart work in modern organizations. Integrated information systems such as solutions at the whole organization level are the supporting pillar in such promotion of organizations. The purpose of the course is to get acquainted with information systems and focus on key aspects in providing solutions based on integrated information systems - from the way they conclude, the organization of the life cycle, development, commissioning, to the extinction and transition to new ones. Solutions.

Competences expected to be acquired by the student after completing the subject:
- Understand the importance of introducing information systems management for innovative organizations, companies and institutions in different spheres
- Know how to apply finished platforms for building information systems and to map the typical functionalities of finished platforms, as opposed
- to know how to use modern methodologies for organizing the process of development of information systems
- be able to manage projects covering the entire life cycle of information system development at the whole organization level
- to be able to arguably analyze and criticize past projects for the development of information systems and finished systems in use', '- Предавања и вежби со дискусии базирана на примери, анализа на различни достапни примери
