       ('m23_s_002', '1707', 'Fundamentals of Genetic Engineering', '600', '10', '2', '2023', 'македонски или англиски',
        'Принципи на генетскиот инженеринг; методологија за манипулирање со нуклеински киселини. Прокариотски и еукариотски клетки-домаќини; вектори (плазмиди, бактериофаги, анимални вируси, хибридни и напредни вектори). Техники за внесување на егзогена DNA во клетките. Рестрикциски дигестии и мапирање на геномите. Лигирање-поврзување при клонирањето. Стратегии за клонирање; генски библиотеки; PCR како алтернатива за генското клонирање; клонирање на комплементарна  DNA.  Секвенционирање на  DNA и мутагенеза in vitro. Геномско едитирање со CRISP/CASP системот. Генска манипулација кај експерименталните животни и моделни организми во генетиката.  Примена на генетскиот инженеринг во биологијата, медицината, фармацијата и други. Етика и генетско инженерство',
        'Principles of genetic engineering; methodology for manipulating nucleic acids. Prokaryotic and eukaryotic host cells; vectors (plasmids, bacteriophages, animal viruses, hybrid and advanced vectors). Techniques for introduction of exogenous DNA into cells. Restriction digests and genome mapping. Ligation-linking in cloning. Cloning strategies; gene libraries; PCR as an alternative to gene cloning; cloning of complementary DNA. DNA sequencing and mutagenesis in vitro. Genome editing with the CRISP/CASP system. Genetic manipulation in experimental animals and model organisms in genetics. Application of genetic engineering in biology, medicine, pharmacy and others. Ethics and genetic engineering',
        'Во овој курс се прикажуваат основите на генетското инженерство. Типично методите кои се користат во генетското инженерство се сметаат за многу блиски кон биомедицинските науки. Сепак, во последната декада се покажува дека се повеќе истражувачи од класичните инженерски дисциплини се насочени кон генерирање на посакувани карактеристики користејќи ги биолошките принципи. По успешното завршување на овој предмет, студентот ќе биде во состојба да ги разбере начините на кои се одделуваат и модифицираат гените, во природата и во лабораториски услови. Студентите треба да се стекнат со проширени знаења за рекомбинантна  DNA  технологија (генетското инженерство) и нивната примена.',
        'This course presents the basics of genetic engineering. Typically the methods used in genetic engineering are considered very close to the biomedical sciences. However, in the last decade it has been shown that more and more researchers from classical engineering disciplines are focused on generating desired characteristics using biological principles. After successful completion of this course, the student will be able to understand the ways in which genes are separated and modified, in nature and in laboratory conditions. Students should acquire extensive knowledge of recombinant DNA technology (genetic engineering) and their applications.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби
