        '180', '15', '45', '0', '15'),
       ('m23_s_004', '1706', 'Information processing in biological systems', '600', '10', '2', '2023',
        'македонски или англиски',
        'Генетски систем и процесирање информации во генетскиот системи. Процесирање информации на клеточно ниво. Концепти за подорганизам и организам. Еволуција и тек на еволуциска информација. Развој. Инженерска интервенција на генетско и развојно ниво. Медицинска рехабилитација и интервенции. Процесирање на информации на ниво на популации.',
        'Genetic system and information processing in genetic systems. Information processing at the cellular level. Concepts of sub-organism and organism. Evolution and flow of evolutionary information. Development. Engineering intervention at the genetic and developmental level. Medical rehabilitation and interventions. Information processing at the population level.', 'Живите системи се најкомплексните системи и како такви се постојан предмет на интерес како во медицинско - биолошките науки, така и во инженерските науки.Во потесна смисла, во овој предмет е даден опис на потсистемите и компонентите на живите системи и односите и комуникацијата меѓу нив.Се осврнуваме на моделирањето на живите системи, алатките за моделирање на системите и потсистемите, како и начините на меѓусебна комуникација на нано, микро и макро ниво. Предметот се осврнува и на формалното претставување на сигналите кои се карактеристични за живите организми. Аспекти на инженерска интервенција во живите системи се исто така дел од овој.
Компетенции: По успешното завршување на овој предмет, студентот ќе биде во состојба: да ја разбира био-молекуларната специфичност на живите организми, јасно да ги воочува влијанието на апстракцијата и моделирањето на живите системи инивните потсистеми, да биде оспособен за моделирање на процесирањето насигналите добиени од сите нивоа на живите системи, и да има разбирање за можноста на инженерска интервенција на сите нивоа на живите системи;', 'Living systems are the most complex systems and as such are a constant subject of interest both in medical - biological sciences and in engineering sciences. In a narrower sense, this subject describes the subsystems and components of living systems and the relationships and communication between them. We refer to the modeling of living systems, the tools for modeling systems and subsystems, as well as the ways of mutual communication at the nano, micro and macro level. The subject also refers to the formal representation of signals that are characteristic of living organisms. Aspects of engineering intervention in living systems are also part of this subject.
Competences: After successful completion of this course, the student will be able to: understand the bio-molecular specificity of living organisms, clearly perceive the impact of abstraction and modeling of living systems and subsystems, be able to model the processing of received signals from all levels of living systems, and to have an understanding of the possibility of engineering intervention at all levels of living systems;', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети
