- algorithms to compare genomes
- classification of sequences using probable models
- Algorithms for analyzing data from expression of genes', 'Во овој курс ќе се истражуваат пресметковните проблеми кои се појавија од секвенционирањето на геномот. Студентите ќе се здобијат со знаење за:
