Во текот на курсот посебен акцент ќе биде ставен на ефикасни алгоритми дизајнирани да ги задоволат предизвиците на брзо растечките збирки на податоци во тековната ера на секвенционирање на геномот со висок проток.', 'This course will explore the calculations that arise from the sequencing of the genome. Students will gain knowledge of:
