       ('m23_s_016', '1711', 'Intelligent interactive systems', '600', '9', '2', '2023', 'Македонски и англиски', 'Во предметот се изучуваат содржини кои ги покриваат аспектите на избор на најсоодветните интелигентни техники (применета вештачка интелигенција и машинско учење) за поддршка на интеракцијата човек -комјутер која соодветсвува на способностите, можностите и преференците на поединецот или групата корисници.
