•	Мултимодална интеракција со примена на најнови интелигентни технологии од областа на длабоко учење, учење со поттикнување и агентно-базирани системи.
•	Апликативни домени и студии на случај (системи за препораки, подршка во одлучување, асистивни системи, мултимодална интеракција)
•	Дизајн на процедура и сценарио за споредување на експериментални студии и евалуација на интелигентни интерактивни системи
•	Системи за препорака
•	Интерпретабилна ВИ (Explainable AI)', 'The subject taught contents that cover the aspects of choosing the most appropriate intelligent techniques (applied artificial intelligence and machine learning) to support the interaction of a human -compresser that adheres to the capabilities, opportunities and preferences of the individual or group of users.
