• Multimodal interaction with the application of the latest intelligent technologies in the field of deep learning, learning by encouraging and agent-based systems.
• Applicable Domains and Case Studies (Recommendation Systems, Decision Support, Assistive Systems, Multimodal Interaction)
• Procedure design and scenario for comparison of experimental studies and evaluation of intelligent interactive systems
• Recommendation systems
• Interpretable (Explainable AI)', 'Целта на предметот е студентот да се стекне со знаење за новите интелигентни методологии и технологии за поприродна. Од посебен значај е научниот приод кон
