       ('m23_s_017', '2924', 'Assistive technologies', '600', '10', '2', '2023', 'Македонски',
        'Вовед во асистивни технологии. Користење софтверски алатки во процесите на едукација. Еволутивен и невролошки базиран дизајн на интерфејс. Колаборативни техники на соработка  во образовниот процес со употреба на асистивни технологии. Поим за интерфејс за лица со специјални потреби.  Когнитивни, перцептивни и моторни предизвици на учениците со специјални потреби. Уреди и софтвер за работа со корисници со когнитивни и сензорски специјални потреби.',
        'Introduction to assistive technologies. Using software tools in education processes. Evolutionary and Neurologically Based Interface Design. Collaborative techniques of cooperation of the participants in the educational process with the use of assistive technologies. Concept of interface for people with special needs. Cognitive, perceptual and motor challenges of students with special needs. Devices and software for working with users with cognitive and sensory special needs.',
        'Студентите ќе се запознаат со концептот на асистивни технологии, како и со историските аспекти на помошните технологии. Тие ќе научат како да користат асистивна технологија, во секојдневните активности и во образовниот процес. Тие ќе станат способни да разберат и имплементираат помошни технологии за успешно задоволување на потребите на различни групи корисници. Посебно внимание ќе се посвети на дефинирање и препознавање на когнитивните и сензорните предизвици на лицата со посебни потреби. Учениците ќе научат како да ги надминат тешкотиите со користење на современи асистивни технологии.',
        'Students will become familiar with the concept of assistive technologies, as well as historical aspects of assistive technologies. They will learn how to use assistive technology, in every day activities and in the educational process. They will become capable of understanding and implementing assistive technologies to successfully meet the needs of different user groups. A special attention will be given to definition and recognition of cognitive and sensory challenges of people with special needs. The students will learn how to overcome difficulties with the use of modern assistive technologies.',
