        'Introduction to microprocessors and microcontrollers. Embedded systems. Basic properties of electric energy. Open-Source platforms for the development of interactive systems. Design of electric circuits. Characteristics of different components. Sensors. Building and programming interactive systems.',
        'Студентите да се запознаат со платформите за работа со хардвер и потребата од вградливи системи. Вовед во микропроцесори и микроконтролери. Преглед на својствата на електричната енергија како јачина и напон. Употреба на компоненти како LED, преклопници, отпорници, диоди, кондензатори, серво и степер мотори, и сензори за имплементација на интерактивни системи. Програмирање на микроконтролерите и овозможување на интеракција помеѓу компонентите. Студентите ќе се оспособат да изработуваат едноставни проекти за полесно совладување на СТЕМ образованието, со помош на платформите како Ардуино и Микро-бит.',
        'Students get acquainted with hardware work platforms and the need for embedded systems. Introduction to microprocessors and microcontrollers. Overview of the properties of electricity such as strength and voltage. Use of components such as LEDs, switches, resistors, diodes, capacitors, servo and stepper engines, and sensors for the implementation of interactive systems. Programming microcontrollers and enabling interaction between components. Students will be able to develop simple projects to easily master Stem education, with the help of platforms such as Arduino and Micro-bit.',
