       ('m23_s_019', '1728', 'Human-Robot Interaction', '600', '10', '2', '2023', 'македонски или англиски',
        'Социјална роботика, Човек-компјутер комуникација, мулти-модални уреди, сензори и перцепција за интеракцијата човек - робот, Интеракција  мозок - робот. Апликативен домен: примена во авијација, индустрија, медицина, хазардни средини. Интеракција човек-робот за специјални групи корисници: деца, постари корисници, болни луѓе. Роботи во асистивни технологии.',
        'Social robotics. Human-computer communication, multi-modal devices, sensors and perception for human robot - interaction. Brain-robot interaction. Application domain: application in aviation, industry, medicine, hazardous environments. Human-robot interaction for special groups of users: children, elderly users, sick people among others. Robots in assistive technologies.', 'Предметот има за цел да се поврзат полињата на истражување на човековата природа и роботиката. Овозможува да се равијат методологии за областите роботика и когитивна психологија, да се најде попририден начин на инкорпорирање на роботите во различни сфери од човековото секојдневие. Насочува кон овозможување на поприродна интеракција меѓу луѓето и роботите. Се  изучуваат и можностите за директна комуникација мозок – робот.
Компетенции: По успешното завршување на овој предмет, студентот ќе биде во состојба: да ја разбира потребата на вметнување на роботите во секојдневието на луѓето и начинот на кој тие го подобруваат тоа секојдневие, да се стекне со основни знаења за користењето на повеќе роботи во различни апликативни домени како медицина, рехабилитација, социјализација, индустрија, транспорт, и да се стекне со познавање за корисноста на употребата на роботите за подобрување на социјалните капацитети на различни групи корисници', 'The course aims to connect the research fields of human nature and robotics. It allows developing methodologies for robotics and cognitive psychology, enables a more natural way of incorporating robots into different spheres of human everyday life. It aims to enable more natural interaction between humans and robots. The possibilities of direct brain-robot communication are also studied.
Competences: After successfully completing this course, the student will be able to: understand the need to incorporate robots into people`s everyday life and will be able to see the way they improve that everyday life, acquire basic knowledge about the use of multiple robots in different application domains such as medicine, rehabilitation, socialization, industry, transportation, and to gain knowledge about the utility of using robots to improve the social capacities of different groups of users', 'Предавања, вежби, самостојна работа, проектни задачи,
