       ('m23_s_021', '0', 'Computational epidemiology', '600', '10', '2', '2023', 'македонски и англиски',
        'Основни популациски епидемиски модели СИР и СИС. Симулација на популациските модели СИР и СИС. Одредување на епидемиската граница и основниот репродукциски број. Симулација на модели со агенти за опис на ширење на зараза низ комплексни мрежи. Посложени епидемиски модели. Симулација на сценарија со вакцинирање. Нагодување на параметрите на моделите според набљудувањата.',
        'Basic compartmental epidemic models: SIR and SIS. Simulation of the compartmental SIR and SIS models. Determination of the epidemic threshold and the basic reproduction number. Simulation of agent based models for description of epidemic spreading on complex networks. Epidemic models with more compartments. Simulation of vaccination scenarios. Fitting models to data.',
        'Студентите ќе се запознаат со основните модели за ширење на заразни болести, како што се СИР и СИС.  Ќе бидат проучени популациските верзии на моделите, но и оние засновани со агенти. Со тоа студенитите ќе стекнат способност за решавање на моделите со помош на нумерички симулации. Од моделите ќе може да се излекуваат заклучоци за текот на епидемијата како згаснување, или нејзино понатамошно ширење, но и проучување на можните ефетки од разни сценарија за вакцинирање',
        'Students will be introduced to the basic contagious disease models like SIR and SIS. It will be studied compartmental models, but also agent based ones. Students will gain knowledge for solving models with numerical simulations. From the models they will be able to draw conclusions about the future course of an epidemic like its fading, or its outbreak, but also to study the possible effects of different vaccination scenarios.',
        'Предавања, проекти, дискусии, работилници', 'механизам на интерна евалуација и анкети', 'NULL',
        'реализирани активности 15', '60', '0', '45', '45', '30', '180', '15', '45', '0', '15'),
       ('m23_s_022', '544', 'NetDevOps', '600', '10', '2', '2023', 'македонски и англиски',
        'Стратегии кои може да се користат од инженерите за иницирање на културна промена потребна за автоматизација на мрежните функции. Мрежни стратегии за брзо скалирање на нови проекти. Софтверски дефинирани мрежи SDN. Мрежни технологии во јавен и приватен облак. Како пристап кој се заснова на користење на  API може да реши типични проблеми во мрежната средина. Влијание на автоматизацијата врз мрежната безбедност во софтверски дефинирана мрежа. Алатки за конфигурација, како на пример Ansible и Jenkins, кои може да се користат за оркестрација и конфигурација на мрежни уреди. Поставување на околина за постојана интеграција, поставување и ставање во продукција на мрежни функции преку автоматизирани проточни процеси (continuous integration). Креирање на тест околини за мрежни промени. Виртуелни контејнери и нивното влијание врз мрежната околина. Софтверско дефинирано балансирање на оптоварувањето во околина со микросервиси. DevOps процеси и работни текови за овозможување автоматизација во мрежата.',
        'Strategies that can be used by the engineerings to initiate cultural change required for network function automation. Network strategies for fast scaling of new projects. Software defined networks SDN. Network technologies in public and private cloud based environments. Using API based approaches to solve typical problems in the network environment. Influence of automation on network security. Configuration tools, such as Ansible and Jenkins, that can be used for orchestration and configuration of network devices. Setting up an environment for continuous integration, setting up production network functions using automated continuous integration. Creation of test environments for network changes. Virtual containers and their influence on the network environment. Software defined load balancing in a microservices environment. DevOps processes and workflows to enable network automation.',
        'Студентот треба да се стекне со знаења кои ќе му овозможат да ги имплементира мрежните основи и потреби во рамките на  DevOps културата со што ќе се подобри стабилноста на организацијата. Ќе се стекне со разбирање и користење на напредни мрежни технологии како SDN и NFV и знаење како да употребува напредни алатки со отворен код за автоматизација на мрежата. Предметот ја воведува основата за поддршка и соработка помеѓу развивачите и мрежните админстратори.',
        'The student should gain knowledge that will enable him to implement the network requirements using the concepts from the DevOps culture which will lead to improving the organisational stability. The student will gain understanding and will be able to use the advanced networking technologies such as SDN and NFV and know how to use advanced open source tools to automate network setup and configuration. The course defines the basis for support and collaboration between the software developers and the network administrators.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '45', '15', '30', '50', '40',
        '180', '45', '50', '0', '10'),
       ('m23_s_023', '1713', 'Multimodal interaction', '600', '10', '2', '2023', 'македонски и англиски',
        'Дизајн на мултимодална интеракција. Дизајн, моделирање и анализа на мултимодални влезни уреди која вклучува: препознавање на говор, препознавање и следење на црти и изрази на човечко лице,  препознавање на гестови, интеркација без допир, сензори на памени телефони и во паметни околини. Мултимодални излезни уреди која вклучува: синтеза на говор, интеркација преку звучни објекти, тактилни интерфејси. Надградена реалност. Автоматска анализа на мултимодално однесување.',
        'Design of multimodal interaction. Design, modeling and analyzing multimodal input devices that include: Recognizing speech, recognizing and tracking traits and expressions of the human face, gesture recognition, touch -free interceptions, passage phones sensors and smart environments. Multimodal output devices that include: speech synthesis, sound object intercalists, tactile interfaces. Upgraded reality. Automatic analysis of multimodal behavior.',
        'Луѓето користат различни сетила и системи за меѓусебна комуникација, симултано (лице во лице конверзација) или алтернативно (со користење на говор, пишување, гестикулација, допир). Традиционално комуникацијата со компјутерите се одвивала преку тастатура и глушец и компјутерот одговарал најчесто со визуелни стимули во форма на текст или слики. Целта на курсот е да ги воведе студентите во новите начини на интеракција со компјутерските системи што овозможуваат подорбување на искуството или ефикасноста на интеракцијата со истите (контрола со звук, звучна интеракција, препознавање на гестови, екрани на допир, таткилни интерфејси, надградена реалност).',
        'People use different senses and systems for mutual communication, simultaneous (face -to -face conversation) or alternatively (using speech, writing, gestures, touch). Traditionally communicating with computers was carried out through the keyboard and mouse and the computer was most often suited with visual stimuli in the form of text or images. The purpose of the course is to introduce students in new ways of interacting with computer systems that allow for better experience or efficiency of interaction with them (sound control, sound interaction, gesture recognition, touch screens, tatal interfaces, upgraded reality).',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '60', '0', '45', '45', '30',
        '180', '15', '45', '0', '15'),
       ('m23_s_025', '584', 'Knowledge discovery in big graph data', '600', '10', '2', '2023', 'македонски и англиски',
        'Вовед во откривање знаење во големи граф податоци; Статички графови: закони и шаблони; Динамички графови: закони и шаблони; Анализа на врски: Random walks, PageRank, HITS; Класификација на јазли; Сличност на јазли; Сличност на графови; Порамнување на графови; Кластерирање на графови; Откривање непреклопувачки и преклопувачки заедници; Предвидување на врски; Детекција на аномалии; Детекција на чести под-графови; Апроксимација и компресија на графови; Репрезентација на графови; Длабоко учење кај графови; Области на примена: Откривање знаење во протеински интеракциски мрежи, Откривање знаење во мрежи од мозок, Откривање знаење во социјални мрежи, Откривање знаење во хетерогени мултимодални податоци, Граф-базирани системи за препораки.',
        'Introduction to Detecting Knowledge in Large Graf Data; Static graphs: laws and templates; Dynamic graphs: laws and templates; Link analysis: Random Walks, Pagerank, Hits; Classification of knots; The similarity of knots; Similarity of graphs; Alignment of graphs; Clustering graphs; Detecting non -collecting and overlapping communities; Prediction of relationships; Detection of anomalies; Frequent sub-grafts; Approximation and compression of graphs; Graphs representation; Deep learning in graphs; Areas of application: Detection of knowledge in protein interaction networks, detection of knowledge in brain networks, knowledge detection in social networks, knowledge detection in heterogeneous multimodal data, graph-based recommendation systems.', 'Овој курс има за цел да ги воведе студентите во областа на откривање знаење во големи граф организирани податоци. Студентите ќе се запознаат со предизвиците на процесирање на големи количини на податоци, најсовремени методи и алгоритми за анализа на графови, и примена на откривање знаење во големи граф податоци во различни апликативни домени. По завршување на предметот се очекува студентите да се здобијат со:
-	Темелно разбирање на основите на откривање знаење во граф податоци
-	Способност за критично размислување во однос на различни методи и алгоритми за извлекување знаење
-	Способност за формулирање и решавање на проблеми кои можат да се пресликаат во домен на графови
-	Способност за анализа на големи податочни множества за графови', 'This course aims to introduce students in the field of knowledge detection in large graph organized data. Students will get acquainted with the challenges of processing large amounts of data, state -of -the -art methods and algorithms for graphs analysis, and the application of knowledge detection in large graph data in various application domains. Upon completion of the subject, students are expected to acquire:
- a thorough understanding of the basics of knowledge detection in graph data
- Ability to critical thinking about different methods and algorithms to extract knowledge
- Ability to formulate and solve problems that can be replicated in the domain of graphs
- Ability to analyze large data sets', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби
(користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
