        '15'),
       ('m23_s_026', '637', 'Software architectures', '600', '10', '2', '2023', 'македонски и англиски', 'Софтверски архитектури – дефиниција и преглед. Квалитет на софтвер и софтверски архитектури. Дизајнирање на софтверски архитектури. Креирање и анализа на архитектури. Различни погледи во архитектурата на софтверот. Јазик за опис на
софтверски архитектури. Документирање на софтверски архитектури. Ревизија на софтверски архитектури. Архитектонски стилови. Шаблони на софтверски архитектури. Архитектурни рамки. Реупотреба на софтверски архитектури.', 'Software architectures - definition and review. Software quality and software architectures. Designing software architectures. Creating and analyzing architectures. Different views of software architecture. Language for a description of
Software architectures. Documenting software architectures. Audit of software architectures. Architectural styles. Software architecture templates. Architectural frameworks. Reuse of software architectures.',
        'Целта на курсот е да продуцира „софтверски архитекти“ со солидно знаење и компетентност во градењето на робусни, скалабилни, и доверливи софтверско-интензивни системи на ефективен начин. По завршувањето на курсот се очекува кандидатите: да имаат јасна претстава за улогата на апстракцијата, моделирањето, архитектурата и шаблоните за дизајн при развојот на софтверски продукт; да изберат оптимална архитектура, да ги примената најрелевантните методи и технологии за изведба на софтверското решение независно од неговата комплексност и големина; да имаат разбирања за концептите и принципите на софтверските архитектури како и прецизно да ги опишат; да ги препознаваат главните архитектонски стилови во постојни софтверски системи; да изградат софтверска архитектура и глобален дизајн тргнувајќи од поставените барања или преку реверзно инженерство; да генерираат разумен број алтернативни архитектури за даден проблем и да избираат меѓу нив; да евалуираат комерцијални софтверски алатки и софтверски компоненти од аспект на архитектурата; да употребуваат објектно-ориентирани модели и алатки за ефикасно изведување на своите активности ; да применуваат шаблони, стилови и рамки при креирањето на софтверска архитектура; да можат систематски да евалуираат дадена софтверска архитектура; јасно да ја разбираат врската помеѓу софтверска архитектура и останатите дисциплини од софтверското инженерство.',
        'The purpose of the course is to produce software architects with solid knowledge and competence in building robust, scalable, and trusted software-intensive systems in an effective way. Candidates are expected to have a clear idea of ??the role of abstraction, modeling, architecture and design templates in software product development; to choose optimal architecture, apply the most relevant methods and technologies for the performance of the software solution regardless of its complexity and size; to have understandings of the concepts and principles of software architectures as well as to accurately describe them; to recognize the main architectural styles in existing software systems; to build software architecture and global design starting from the requirements set or through reversal engineering; to generate a reasonable number of alternative architectures for a given problem and to choose between them; to evaluate commercial software tools and software components in terms of architecture; to use object-oriented models and tools to effectively perform their activities; to apply templates, styles and frames when creating software architecture; be able to systematically evaluate a given software architecture; clearly understand the link between software architecture and other software engineering disciplines.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '60', '0', '45', '45', '30',
        '180', '35', '45', '0', '10'),
       ('m23_s_027', '636', 'Shape recognition', '600', '10', '2', '2023', 'македонски и англиски', 'Машинска перцепција. Теорија на статистичко одлучување. Баесова теорија на одлучување. Оптимални одлуки, класификација, веројатносни распределби. Димензионалност, капацитет на калсификатор, избор на модел, обука, евалуација, комплексност. Параметарски пристап кон учењето. Основни статистички техники, поместување и
варијанса; проценка на густина, регресиона и анализа на дискриминанта. Непараметарски техники, методи на најблизок сосед, флексибилни метрики. Линеарни дискриминантни функции, Фишеров класификатор, невронски мрежи и машини со носечки вектори како класификатори. Неметрички методи, дрва за одлучување. Маркови вериги, примена на скриен марков модел за класификација. Користење на контекстот во препознавањето на облици. Стохастички методи, генетски алгоритми. Проценка на грешка, емпириски критериуми за грешка, интервал на доверливост. Екстракција на обележја, анализа на главни компоненти, избор на подмножество на обележја. Bagging, boosting, комбинирање на класификатори. Дизајн, анализа, имплементација и апликација на алгоритми за препознавање на облици. Практична примена, препознавање на текст, ракопис, говор. Анализа на сцена, роботска визија.', 'Machine perception. Statistical decision -making theory. Baes`s decision -making theory. Optimal decisions, classification, probable distributions. Dimensionality, capacity of clamps, model selection, training, evaluation, complexity. Parametric approach to learning. Basic statistical techniques, moving and
variance; estimate of density, regression and analysis of discriminant. Non -parametric techniques, methods of closest neighbor, flexible metrics. Linear Discriminant Functions, Fisher`s Classifier, Neuronal Networks and Machines with Long Vectors as Classifiers. Non -metrical methods, deciding trees. Markova Verigi, application of hidden Markov model for classification. Using the context in recognizing forms. Stochastic methods, genetic algorithms. Error estimation, empirical error criteria, confidentiality interval. Extraction of features, analysis of main components, selection of inclusions of features. Bagging, boosting, combining classifiers. Design, analysis, implementation and application of form recognition algorithms. Practical application, text recognition, handwriting, speech. Scene analysis, robotic vision.',
        'Целта на курсот е студентите да се запознаат со основите на модерните техники од областа на препознавање на облици и класификација на примероци. По завршувањето на курсот кандидатите: ќе имаат продлабочени знаења за напредните технологии и методи за препознавање на облици; ќе можат да разберат, анализираат и формулираат генерални проблеми од областа на препознавање на облици; ќе можат успешно да применат алгоритми за анализа и препознавање на облици при решавање на реални проблеми; ќе можат да конципираат, анализираат, реализираат и проценат перформанси на систем за препознавање на примероци.',
        'The purpose of the course is to get acquainted with the basics of modern techniques in the field of form recognition and sampling classification. Upon completion of the course candidates: will have deepened knowledge of advanced technologies and methods of form recognition; will be able to understand, analyze and formulate general problems in the field of form recognition; They will be able to successfully apply algorithms for form analysis and recognition when solving real problems; They will be able to conceive, analyze, implement and assess the performance of a sampling system.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '60', '0', '45', '45', '30',
        '180', '0', '45', '0', '10'),
       ('m23_s_028', '1752', 'Advanced coding algorithms', '600', '10', '2', '2023', 'Македонски и алглиски', 'Итеративни методи на декодирање:
    Турбо кодови
