        'Целта на курсот е продлабочување на познавањата во теоријата на кодирање и проучување на напредни и нови аспекти во кодoвите за поправање и откривање на грешки.  Ќе бидат разгледани итеративни и алгебарски методи на декодирање.  Во курсот е предвидена разработка на трудови со нови резултати од теоријата на кодирање.',
        'The purpose of the course is to deepen the knowledge of the coding theory and study of advanced and new aspects in the code fixing and detection code. Iterative and algebraic decoding methods will be considered. The course provides for the elaboration of papers with new results of coding theory.',
