        'Основни концепти на управување со ризиците; важноста на управувањето со ризици за успех во бизнисот; типови на ризици; анализа на ризици; системи, модели и рамки при управување со ризици на информациска безбедност; цели на управувањето со ризици; идентификација на ризиците; стратегии за управување со ризици; управување со промени кај софтверски проeкти, проценка на ризик при промени, организациски промени кај ИТ околини, подобрување на ИТ процеси, промена кон отворен софтвер и софтвер за широка потрошувачка, истражување на случаи за проекти од: ИТ безбедност, пресметување во облак, агилни методи, проекти со надминат буџет и големо доцнење, евладини проекти и нови технологии.',
        'Basic risk management concepts; the importance of risk management for business success; risk types; risk analysis; Systems, models and frameworks when managing information security risks; Objectives of risk management; risk identification; risk management strategies; Management of changes in software projects, risk assessment, organizational changes in IT environment, IT process improvement, open software change and consumer software, project research by: IT security, cloud calculation, agile methods , projects with exceeding budget and high delays, Euladin projects and new technologies.',
        'Курсот ја истакнува потребата од добро менаџирање на ризиците и промените. Со успешно завршување на курсот, студентот ќе може самостојно да идентификува проблеми поврзани со управување на ризиците и нивна примена во информациската безбедност и промените кај софтверски проекти и да примени различни начини и техники на решавање на овие проблеми.',
        'The course highlights the need for good risk management and changes. By successfully completing the course, the student will be able to independently identify problems related to risk management and their application in information security and changes in software projects and to apply different ways and techniques to solve these problems.',
