        'Квалитет на софтвер и процес за управување со квалитетот на софтверот. Развој на софтвер и животен циклус на тестирањето.  Пристапи за тестирање на софтвер. Видови тестови во фазите на развој на софтвер. Техники за избор на тестови базирани на критериуми за покривање (простор на влезни вредности, логика на извршување на акции, синтаксно базирано тестирање). Планирање на тестирањето и изработка на документација. Алатки за автоматизирано извршување на тестови.',
        'Software quality and software quality management process. Software development and test cycle. Software test approaches. Types of tests in software development stages. Techniques for selecting tests based on cover criteria (entry space, action logic, syntax based testing). Planning for testing and documentation. Automated Tests Tools.', 'Целта на курсот е да ги воведе студентите во техниките за управување со квалитетот на софтверот. Областите што ги покрива курсот вклучуваат процес на менаџирање на софтерскиот квалитет, тестирање на софтвер, цели на тестирањето на софтверот, техники за избор на тестови и метрики, дизајнирање на тестови, изведување на тестовите, анализа на податоците добиени од тестовите, животен циклус на тестовите.
По завршување на курсот студентот ќе може - да демонстрира знаење за концептите на процесот на управување со квалитетот на софтверот;
- да дизајнира тестови за различни видови апликации;
- да го реализира тестирањето;
- да ги интерпретира резултатите од тестирањето и истите да ги примени за подобрување на квалитетот на софтверот.', 'The purpose of the course is to introduce students in software quality management techniques. The areas covered by the course include the process of managing softer quality, software testing, software testing, test selection techniques and metrics, test design, tests, test analysis, tests, life cycle of tests .
Upon completion of the course the student will be able to demonstrate knowledge of the concepts of the software quality management process;
- to design tests for different types of applications;
- to carry out the testing;
- To interpret the test results and apply them to improve the quality of the software.',
