- Вовед во H/FOSS (Humanitarian, Free and Open Source Software - Хуманитарен, слободен софтвер и софтвер со отворен код).
- Вовед во авторски права и права на креирање копии, лиценци кои се користат кај H/FOSS, споредба и анализа на придобивки и негативности
- Настава по развој на H/FOSS и H/FOSS во наставата.
- Модели на студентско учење со практична работа во реални проекти.
- Вклучување на студенти во H/FOSS проекти, методи и начини на активно вклучување.
- H/FOSS проекти кои овозможуваат и прифаќаат студентско вклучување.
- Процес на предлагање проекти и теми за учество во постојни проекти, развој на концептуална идеја и план за имплементација.
- Проектна имплементација со користење на H/FOSS
- Евалуација на проектите
- Организација на тимска работа со слободни партиципанти, организација на тимска работа целосно електронски и на далечина
- Организација и користење на портали за споделување, контрола и управување со код  кај  H/FOSS (Примери: OpenHub, Github, Gitlab)
- Организација и користење на системи за слободно колаборативно документирање  кај  H/FOSS (Примери: Wiki)
- Организација и користење на дистрибуирани системи за слободна директна комуникација и слободни социјални мрежи (Примери: IRC, Matrix, ToX, Mastodon, Diaspora)
- Организација и користење на системи за следење на дефекти кај  H/FOSS', 'Topics processed within this subject:
- Introduction to H/FOSS (Humanitarian, Free and Open Source Software - Humanitarian, Free Software and Open Software).
- Introduction to copyright and rights to create copies, licenses used in H/FOSS, comparison and analysis of benefits and negatives
- Teaching for the development of h/foss and h/foss in teaching.
- Student learning models with practical work in real projects.
- Students` involvement in H/FOSS projects, methods and modes of active involvement.
- H/FOSS projects that enable and accept student inclusion.
- Process of proposing projects and topics for participation in existing projects, development of a conceptual idea and plan for implementation.
- Project implementation using H/FOSS
- Evaluation of projects
- Organization of teamwork with free participants, teamwork organization completely electronic and distance
- Organization and use of portals for sharing, control and management of code H/FOSS (Examples: Openhub, GitHub, GitLab)
- Organization and use of free collaborative documentation systems in H/FOSS (Examples: Wiki)
- Organization and use of distributed systems for free direct communication and free social networks (examples: IRC, Matrix, Tox, Mastodon, Diaspora)
- Organization and use of defect monitoring systems in H/FOSS', 'Целта на курсот е студентот да се запознае со начините на функционирање на H/FOSS проектите (Humanitarian, Free and Open Source Software - Хуманитарен, слободен софтвер и софтвер со отворен код) и можностите за вклучување и да стекне искуство со активно вклучување во некој активен H/FOSS  проект.

Компетенции кои се очекува да ги стекне студентот по завршувањето со предметот:
- Да ги разбира предностите и разликите кои ги нудат различните модели на лиценцирање на софтвер со слободен и отворен код
- Да ги разбира начините на комуникација и начините на работа во H/FOSS проекти
- Да стекне искуство со вклучување во некои од активностите на постоен H/FOSS проект', 'The purpose of the course is to get acquainted with the ways of functioning H/FOSS projects (Humanitarian, Free and Open Source Software - Humanitarian, Free Software and Open Source Software) and opportunities for involvement and gaining experience with active involvement in an active H/FOSS project.

Competences expected to be acquired by the student after completing the subject:
- Understand the advantages and differences offered by different software licensing models with free and open source
- Understand the ways of communication and ways to work in H/FOSS projects
- to gain experience involving in some of the activities of an existing H/FOSS project', '- Предавања и вежби со дискусии базирана на примери, анализа на различни достапни примери
- Компјутерски потпомогнато учење
- Електронско и учење на далечина
- Групно истражување и развој
- Користење на релевантни софтверски алатки
- Изработка на проект и одбрана на проектот', 'механизам на интерна евалуација и анкети', 'NULL',
