        'By completing this course, students are expected to know the key elements of software modeling of business processes in an integrated and logical way in business systems. Students should demonstrate a practical understanding of business system integration and its use in the context of the modern business environment. To summarize the functions of Enterprise Resource Planning - ERP systems. Explain the business and technical prerequisites that resulted in the need for ERP systems. To evaluate commercial ERP systems to determine whether they meet business needs. Compare the logical, technological and organizational architectures of such systems. Students should show knowledge of the structure, modules and functionalities of ERP systems',
