Strategies and scenarios for migration, security and storage backups of large data.', 'Ќе бидат проучени трендовите на развој на традиционалните релациони (SQL) системи за управување со бази на податоци, складишта на податоци, како и концептите на NoSQL и NewSQL системи за управување со големи податоци. Ќе бидат разгледани концептите на складирање на податоците на различни мемориски медиуми за складирање. Ќе бидат проучени приодите за централно или дистрибуирано складирање, како и логичка организација по редици, колони, графови или документи. Ќе бидат проучени методите за партиционирање и индексирање на структурирани, (полу/не)структурирани и текстуални податоци.
Ќе се обработат реални пристапи и решенија за надминување на предизвиците од аспект на моделирање, управување, имплементација и пуштање во продукција на системи со големи податоци. Студентите на крајот од предметот ќе знаат кои системи се најпогодни и кои чекори се потребни за воведување на системи за големи податоци во компаниите, како и кои се предизвиците со кои се соочуваат компаниите.', 'Trends on the development of traditional relational (SQL) database management systems, data repositories, as well as the concepts of NOSQL and NewsQL systems for managing large data will be studied. The concepts of storing data on different storage media will be reviewed. Approaches for central or distributed storage will be studied, as well as a logical organization in queues, columns, graphs or documents. The methods of partitioning and indexing structured, (semi/non) structured and textual data will be studied.
Real approaches and solutions will be processed to overcome the challenges in terms of modeling, management, implementation and release for the production of large data systems. Students at the end of the subject will know which systems are most suitable and what steps are needed to introduce large data systems in companies, as well as the challenges that companies face.',
