Security and governance of ML models;
Mitigating risk of ML models;
Strategies for deployment;
Scalability and containerization;
Monitoring and feedback loop;
Model drift detection;
Achieving business value from AI and ML.', 'Овој предмет од напредно податочно рударење ќе покрива модерни техники и алгоритми за предиктивна и прескриптивна аналитика. Курсот ќе се фокурира на применливите аспекти и ќе се концентрира на проблеми и апликации од реланиот свет со цел испорака во продукција на решенија кои користат машинско учење. Овој предмет го надминува јазот помеѓу продукционализација и пуштање во погон на корпоративни решенија и проекти/експерименти од машинско учење. За да се овозможи тоа, предметот ќе дискутира операционализирање на машинско учење (Machine Learning Operations - MLOps), зошто е тоа важно за пуштање на погон на модели изградени со машинско учење во продкциски корпоративни средини. Како разултат, со студентите ќе бидат разработени разновидни идеи, алатки и платформи за инженерство и продукционализација на модели од машинско учење.

Курсот опфаќа три главни столба на MLOps и софтверско инженерство, инженерство на модели и инженерство на пуштање во погон. Меѓу опфатените теми спаѓаат софтверски архитектури за континуирана интеграција и испорака, во контекст на машинско учење и верзионирање на податоци. Дополнително, предметот се фокусира на најдобрите практики во индустријата што се неопходни за пуштање во погон на проекти од машинско учење во корпоративни средини.

Студентите кои успешно ќе го завршат предметот ќе можат да ги објаснат животниот циклус на машинското учење и што е неопходно за да се земе идеја од зачнување до операционализација во корпоративна средина. Дополнително, студентите ќе бидат изложени на современи платформи и технологии на MLOps, како на пример ги Allegro AI, xpresso, Dataiku, LityxIQ, DataRobot, AWS Sagemaker, Jenkins, Slack, Docker, Kubernetes итн.', 'This course in advanced data mining will cover modern predictive and prescriptive analytics algorithms and techniques. The course will prioritize application over theory and concentrate on real-world issues and applications to deliver ML findings that can be put into practice. This course bridges the gap between enterprise production deployment and machine learning projects/experiments. To do that, the course will discuss what Machine Learning Operations (MLOps) is and why it`s crucial for deploying machine learning projects in corporate production settings. As a result, model engineering and deployment engineering ideas, tools, and platforms will be introduced to the students.

The course covers the three MLOps pillars of software engineering, model engineering, and deployment engineering. Software engineering topics covered include software architecture, Continuous Integration/Continuous Delivery, and data versioning. In addition, the course focuses on industry best practices that are crucial for deploying machine learning projects in enterprises.

A student who successfully completes this course will be able to explain the machine learning lifecycle and what is necessary to take an idea from conception to operationalization in an organizational setting. Additionally, students are exposed to cutting-edge MLOps platforms and technologies, including Allegro AI, xpresso, Dataiku, LityxIQ, DataRobot, AWS Sagemaker, Jenkins, Slack, Docker, Kubernetes, etc.',
