        'Организација и употреба на клинички податоци. Стратегии за откривање знаење од медицински набљудувања. Медицински слики - како основен дел од многу медицински дисциплини. Алгоритми и стратегии засновани на и соодветни за медицински слики, предизвици и можни решенија. Временски серии од структурирани податоци. Извлекување клинички моќно знаење од структурирани медицински временски серии, справување со предизвиците, анализирање и наоѓање можни решенија. Податоци што недостасуваат. Дефинирање на фактори на ризик и употреба на информации за развивање препораки за превенција. Дијагноза и прогноза - наоѓање дијагностички биомаркери и биомаркери за прогноза. Анализа на реакција на третманот.',
        'Clinical data organization and usage. Strategies for knowledge discovery from medical observations. Medical images - as a fundamental part of many medical disciplines. Algorithms and strategies based on and appropriate for medical images, challenges and possible solutions. Temporal time series of structured data. Extracting clinically powerful knowledge from structured medical time series, coping with challenges, analyzing and finding possible solutions. Missing data. Defining risk factors and the information usage to develop recommendations for prevention. Diagnosis and prognosis - finding diagnostic biomarkers and biomarkers for prognosis. Treatment reaction analysis.', 'Напредокот во медицината и генетиката, како и брзата еволуција на технологијата, континуирано го зголемуваат количеството на генерирани биомедицински податоци во клиничките и истражувачките центри. Се произведуваат различни типови податоци, вклучувајќи медицински слики, генетски маркери, резултати од когнитивни тестови, резултати од крв итн. Сите тие треба да бидат ефикасно организирани, складирани, анализирани и репрезентирани со цел да се обезбеди полесен и посоодветен пристап до нив, како и да се овозможи употреба од тие податоци за откривање на знаење, предвидување и прогноза. Ова може да ги поддржи, па дури и да ги подобри дијагностичките и терапевтските процеси. Брзиот развој во областа на машинското учење  има значајно влијание во биомедицинскиот домен, каде големата разновидност на задачи и типови податоци отвора простор за примена на алгоритми за машинско учење и користење на нивните придобивки.
Курсот има за цел да им овозможи на студентите да стекна способност да поставуваат и одговараат значајни клинички прашања, да ги користат најрелевантните методи и примени на ML во биомедицината и здравството, манипулација и анализа на (големи) податочни множества, означување и индексирање на неструктурирана содржина, откривање на клинички релевантно знаење, интелигентно инженерство на обележја, идентификување кои податоци и алгоритми обезбедуваат најдобро предвидување и/или прогноза, да овозможат поддршка во процесот на дијагностицирање и терапевтски третмани на различни начини.', 'Advances in medicine and genetics, as well as the rapid evolution of technology, continuously increase the amount of generated biomedical data in the clinical and research centers. Variety of data types are produced, including medical images, genetic markers, cognitive tests results, blood results etc. They all need to be efficiently organized, stored, analyzed, and represented in order to provide easier and more appropriate access, and to enable use of those data for knowledge discovery, prediction and prognosis. This could support and even, improve the diagnostic and therapeutic processes. The rapid development in the field of machine learning is having a profound impact in biomedical domain, where the great variety of tasks and data types open space for applying machine learning algorithms and using their benefits.
Тhe course aims to give students the ability to pose and answer meaningful clinical questions, use the most relevant methods and applications of machine learning in biomedicine and healthcare, (large-scale) data manipulation and analysis, annotation and indexing of unstructured content, clinically relevant knowledge extraction, intelligent feature engineering, identify what data and algorithms provide best prediction and/or prognosis, support the diagnostics and therapeutic treatments in different ways.',
