       ('m23_s_060', '0', 'Linear Programming', '600', '10', '2', '2023', 'македонски', '1. Елементи од теоријата на конвексни полиедри (конвексни множества, пар заемно-дуални системи линеарни равенки и неравенки, конвексни конуси, конвексни многустрани конуси, конвексни многустрани множества, конвексни полиедри)

2. Задача на линеарното програмирање (ЛП) (еквивалентна форма на ЛП задачата, допустлива област, екстремални програми, стандарден вид на ЛП-задача, базни програми, геометриска интерпретација на ЛП-задачата во Rn и Rm)

3. Симплекс метод (основни теореми на методот симплекс, симплекс алгоритам, наоѓање почетна базна програма, дегенерација и цикл, лексикографски облик на методот симплекс, модифициран симплекс алгоритам)

