5. Специјални ЛП-задачи и методи (класична транспортна задача, правило на северозападниот агол, решение на класична транспортна задача, варијанти на транспортната задача, ЛП задача со блок-структура, постоптимални задачи, параметарски задачи)

6. Дискретно програмирање (примери на целобројни задачи, методи на отсекување, дискретен алгоритам, цикличен алгоритам, приближни методи, адитивен алгоритам, алгоритам на Белман)', '1. Elements of convex polyhedra theory (convex sets, pair of mutual-dual systems of linear equations and inequalities, convex cones, convex plague cones, convex sets, convex polyhedra)

