3. Simplex method (basic theorems of Simplex method, simplex algorithm, finding an initial base program, degeneration and cichle, lexicographic form of Simplex method, modified simplex algorithm)

4. Duality in linear programming (definition of a pair of dual-dual LP-attacks, basic theorem in duality, function of Lagrange for the pair of intermittent-dual LP-deficit, dual simplex algorithm, finding an initial dual-permeable solution, economic interpretation. Dual tasks, matrix games and duality)

5. Special LP-Tasks and Methods (classic transportation task, rule of northwest angle, classic transportation solution, transportation variants, LP task with block structure, existing tasks, parametric tasks)

6. Discrete programming (examples of integer tasks, cutting methods, discreet algorithm, cyclic algorithm, approximate methods, additive algorithm, Belmann algorithm)',
