        'New technologies such as catalysts of changes in humanity; Introduction to engineering ethics; Online ethics; Network communication and its impacts; Social networks, organized crime and terrorism; Intellectual property; Protection of intellectual and industrial property; Internet neutrality; Access to information and freedom of speech; The privacy of information; The impact of privacy oversight; Privacy and governments; Privacy Protection Techniques; Computer and network security; Social Engineering; Computer Promotion: Technologies Law; Professional ethics; Codes of professional behavior',
        'Инженерската етика е севкупност на индивидуални, професионални и општествени норми кои придонесуваат за воспоставување високи стандарди на професионалното и етичкото однесување. Целта на овој предмет е да го согледа општественото и професионалното влијание на инженерските професии фокусирајќи се на микро и макро етичките проблеми што произлегуваат од нивното однесување, вклучувајќи ги проблемите со вмрежувањето и Интернетот, интелектуалната сопственост, приватноста, безбедноста, надежноста и одговорноста. Исто така, предметот ќе се обиде да ја подигне свеста за итноста од согледување на проблемите што со себе ги носи развојот на новите технологии и интелигентните машини, кои веќе го менуваат човештвото што денес го познаваме.',
        'Engineering ethics is the amount of individual, professional and social norms that contribute to the establishment of high standards of professional and ethical behavior. The purpose of this course is to perceive the social and professional influence of engineering professions by focusing on micro and macro ethical problems arising from their behavior, including problems with networking and internet, intellectual property, privacy, security, reliability and responsibility. The subject will also try to raise awareness of the urgency of perceiving the problems that the development of new technologies and intelligent machines that are already changing the humanity we know today.',
