        'Градовите доживуваат огромна експанзија која со себе повлекува зголемена потреба за мобилност. Енормниот раст на мобилноста е еден од клучните фактори за загаденоста и безбедноста во градовите. Главното решение на овие проблеми е воведување на концептот на паметна мобилност чија цел е да се намали бројот на возила преку оптимизација на нивните рути и иксористеност, интермодалност на превозни средства и споделување. Автоматизацијата на возилата и нивната автономност не само што воведуваат поголема безбедност, туку овозможуваат мобилноста да се нуди како сервис со кој се намалуваат трошоците за транспорт и се намалува и просечното време на патување.  Главните цели на предметот ќе бидат разработување на  сите  концепти кои произлегуваат од паметната мобилност како и техничките потреби за остварување на комуникација помеѓу мобилните јазли за нејзина имплементација.',
        'The cities experience a huge expansion that entails an increased need for mobility. The enormous growth of mobility is one of the key factors for pollution and security in cities. The main solution to these problems is the introduction of the concept of smart mobility aimed at reducing the number of vehicles by optimizing their routes and spare, intermodability of means of transport and sharing. Vehicle automation and their autonomy not only introduce greater safety, but also allow mobility to be offered as a service that reduces transportation costs and reduces the average travel time. The main goals of the subject will be to work out all concepts arising from smart mobility as well as the technical needs for communicating between mobile nodes for its implementation.',
