        'македонски, англиски', 'Теми обработени во рамките на овој предмет:
- Вовед во големи податоци. Потреба и вредност на големи податоци. Големи податоци од социјални мрежи.
- Моделирање на големи податоци и статистичка обработка на големи податоци.
- Пребарување и рударење на големи податоци.
- Научни апликации со големи податоци.
- Приватност, интегритет и заштита на големи податоци.
- Вовед во дистрибуирано процесирање податоци.
- Алатки, алгоритми и техники за програмирање за процесирање на големи податоци, како HDFS, MapReduce, Zookeeper, HBase и други.
- Дизајн и архитектура на дистрибуирани податоци и дистрибуирани системи на бази податоци.
- Процесирање прашалници во дистриубирана средина.
- Диструбуирана контрола на конкурентен пристап и концепти на евентуална конзистентност.
- Управување со дистрибуирани бази податоци.
- Процесирање прашалници во дистриубирана средина
- Стриминг на податоци и пресметување во облак
- Управување со NoSQL за големи податоци. Graph Analytics.', 'Topics processed within this subject:
- Introduction to large data. Need and value of large data. Large data from social networks.
- Modeling large data and statistical processing of large data.
- search and mining large data.
- scientific applications with large data.
- Privacy, integrity and protection of large data.
- Introduction to distributed data processing.
- Tools, algorithms and programming techniques for processing large data, such as HDFS, Mapreduce, Zookeper, Hbase and others.
- Design and architecture of distributed data and distributed bases data systems.
- Processing questionnaires in the distribution environment.
- Distributed control of competitive approach and concepts of possible consistency.
- Managing distributed bases data.
- Processing questionnaires in distributed environment
- streaming data and calculating in the cloud
- NOSQL management for large data. Graph Analytics.', 'Целта на курсот е студентот да се запознае со концептите на големи податоци, и процес на нивна анализа од дистрибуирано масовно складирање, до дистрибуирано масовно процесирање (во живо во текот на собирање или по собирањето) и анализи на резултатите од процесирањето на податоците со цел поддршка на одлучување, бизнис подобрување и подобрување на текови и процеси.

Компетенции кои се очекува да ги стекне студентот по завршувањето со предметот:
- да познава техники и методи за масовно дистрибуирано складирање на големи податоци
- да познава техники и методи за масовна дистрибуирана подготовка на големи податоци за идна обработка
- да познава техники и методи за масовно и дистрибуирано процесирање и анализа на големи податоци
- да ги примени стекнатите знаења во конкретен реален проект за складирање, обработка и процесирање и анализа на дистрибуирани и големи податоци
- да ги оспособи идните архитекти да проектираат дистрибуирани решенија за управување со податоци,
- да ги оспособи софтверските инженери да проектираат софтверски решенија во облак кои се базираат над диструбирани бази податоци,
- да им ги презентира фундаменталните принципи и техники на идните истражувачи од областа, и да им даде основа за идна самостојна истражувачка работа', 'The purpose of the course is to get acquainted with the concepts of large data, and the process of their analysis of distributed mass storage, to distributed mass processing (live during collection or collection) and analysis of data processing results in order to support support. The decision -making, business improvement and improvement of flows and processes.

