- Know techniques and methods of mass distributed storage of large data
- Know techniques and methods of mass distributed preparation of large data for future processing
- Know techniques and methods of mass and distributed processing and analysis of large data
- to apply the acquired knowledge in a specific real project for storing, processing and processing and analyzing distributed and large data
- To enable future architects to project distributed data management solutions,
- To enable software engineers to project software solutions in cloud based on distributed databases,
- Present the fundamental principles and techniques of future researchers in the field, and give them a basis for future independent research work', '- Предавања и вежби со дискусии базирана на примери, анализа на различни достапни примери
