Техники за подобрување на процесот на тестирање.', 'Basic notions of software testing.
Introducing the testing process.
What is a test plan and how it is written. Templates for test plans.
Testing dynamics management.
Team management.
Defining resources, time and budget for the test process.
Testing tools.
Control and evaluation of the test process.
Techniques to improve the test process.', 'Целта на курсот е да ги воведе студентите во техниките на управување со процесот на тестирање на софтвер. Студентите ќе се запознаат со основните концепти на организација на процесот на тестирање на софтвер кој вклучува дефинирање на план за тестирање, управување со динамиката на тестирање, ресурси, време и буџет во склоп на организацијата, соодветен пристап при избор на модел, стандарди и алатки за тестирање, контрола и евалуација на процесот на тестирање, како и можности за подобрување на процесот на тестирање на софтвер.
По успешното завршување на овој предмет, студентот ќе може:
- критички да ја процени важноста на управување на процесот тестирањето на софтверот;
- да демонстрира знаење за концептите на процесот на управување со тестирањето на софтверот;
- да го реализира ефикасно процесот на управување на тестирање со софтвер;
- да ги евалуира резултатите од спроведеното  тестирање и истите да ги примени за подобрување на процесот на управување.', 'The purpose of the course is to introduce students to software testing techniques. Students will get acquainted with the basic concepts of organizing the software testing process that includes a define testing plan, managing the dynamics of testing, resources, time and budget within the organization, an appropriate approach to model selection, standards and tools for Testing, control and evaluation of the test process, as well as opportunities to improve the software test process.
Upon successful completion of this subject, the student will be able to:
- critically assess the importance of managing the software testing;
- to demonstrate knowledge of the concepts of the software testing process;
- to realize the process of software test management efficiently;
- to evaluate the results of the test and apply them to improve the management process.',
