        'Вовед, историја, терминологија на видео игри. Основи на дизајнот (физика на играта, тек на играта, дизајн на нивои, правила на игра). Процес на дизајнирање на игри; раскажување приказна, корисничка интеракција, дизајнирање на карактери, дизајнирање на околина, специјални ефекти во игрите, програмска структура на играта. Визуелни илузии, визија, видови геометриски илузии. Техники за дизајнирање на визуелни ефекти. Напредни моделирачки техники што се користат за креирање на специјални ефекти. Специјални ефекти со слики и анимација.',
        'Introduction, history, terminology of games. Basics of design (game physics, game flow, level design, game rules). Game Design Process; storytelling, user interaction, character design, environment design, special effects in games, game programming structure. Visual illusions, vision, types of geometric illusions. Visual Effects Design Techniques. Advanced modeling techniques used to create special effects. Special effects with images and animation.',
        'Целта на курсот е да ги запознае студентите со основните техники и концепти за дизајнирање на видео игри и специјални ефекти. Областите како раскажување приказна, креирање на карактери, пресметување на поени и психологијата на игрите се дел од темите што се покриени во курсот. Во курсот е одделен и простор за запознавање на студентите со концептот на специјални ефекти и како истите се креираат и користат. Дополнително студентите е потребно да дизајнираат игра на основа на стекнатите теоретски знаења. По завршување на курсот се очекува студентите да демонстрираат знаење за историскиот развој на игрите, да може да го анализираат пазарот на видео игри, да ги дефинираат барањата за дизајнирање на различни видови игри, да дизајнираат и развиваат прототипи на игри, да демонстрираат теоретско знаење што претставуваат специјални ефекти и да стекнат вештини за креирање на едноставни специјални ефекти со користење на готови алатки.',
        'The aim of the course is to introduce students to the basic techniques and concepts of computer game design and special effects. Areas such as storytelling, character creation, scoring and game psychology are some of the topics covered in the course. In the course, there is also a space for familiarizing students with the concept of special effects and how they are created and used. In addition, students are required to design a game based on the acquired theoretical knowledge. Upon completion of the course, students are expected to demonstrate knowledge of the historical development of games, to be able to analyze the computer game market, to define the design requirements of different types of games, to design and develop game prototypes, to demonstrate theoretical knowledge that represent special effects and acquire skills to create simple special effects using ready-made tools.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
