Introducing in practical application of various techniques in scientific programming. Studying the most common problems in scientific programs and the relevant libraries to solve them. Parallization of existing solutions using models of distributed and shared memory as well as GPGPU. Study of current trends in the distributed (Grid) calculation and ways of exploiting them in scientific programming.
Upon completion of the course, the student is expected to be able to implement a parallel or distributed solution to scientific problems using public scientific libraries. At this laboratory course, students simulate the atmosphere using contemporary numerical models and grows to predict time (WRF) and explore the physical and numerical foundation of the equation system and the numerical methods that support numerical models for prediction. Во прилог на развој на технички вештини со WRF и визуелизирање на излезните податоци од моделот со Python, студентите истражуваат апликации на нумеричко моделирање на атмосферата во ограничена област со самостојна подготовка на нумерички експерименти и симулации на атмосферските појави и системи, циклони, урагани, тајфуни, Storms as well as processes related to air pollution, sand transport, volcanic eruptions and so on.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости
