По завршувањето на курсот, се очекува студентот да е во можност да: конфигурира заштита на веб серверите, дизајнира сигурносно решение за мобилни апликации, и имплементира соодветни техники за заштита на мобилните и веб апликации. Студентите ќе бидат во можност да анализираат и одредат слабости на постоечките мобилни и веб апликации, како и да предложат решенија за нивно надминување.', 'The subject will introduce students to possible threats and attacks on web and mobile applications and detecting them. It will give a detailed review of approaches to achieving greater security in mobile and web applications, using: web server security, using the security of mobile operating systems, implementation of application protection mechanisms, promoting AJAX security, Web service protection.
