        'Дизајн, градење, работа и развој на Computer Emergency Response Team (CERT). Раководење со Security operations center. Одговори на инциденти, планови за одговори на инциденти. Управување со безбедносни настани. Проценка на ранливост, анализа на инциденти. Потреби за полиси. Закони и полиси во употреба. Ограничување на ширењето (containment). Форензика и испитувања. Работа со докази. Работа со форензички тим. Законски одредби за форензика. Управување и комуникација на информацијата. Односи помеѓу тимовите.',
        'Design, build, operate and develop a Computer Emergency Response Team (CERT). Management of Security operations center. Incident responses, incident response plans. Security event management. Vulnerability assessment, incident analysis. Policy needs. Laws and Policies in Use. Containment. Forensics and investigations. Working with evidence. Working with a forensic team. Legal provisions for forensics. Management and communication of information. Relationships between teams.',
