        'Потреба и задачи на инфраструктурното управување. Стандардна архитектура за управување (IT Management Architecture). Управување со Интернет мрежна инфраструктура, системска инфраструктура, складишна инфраструктура. Поврзаности на категориите и меѓусебни влијанија. Програмска контрола на квалитет на услуга. Употреба на стандардни протоколи за управување, практики за организација на повисоко ниво, ITIL, заедничко користење на ресурси. Управување со перформанси: доцнење и капацитет. Софтвер за управување и контрола на мрежи и мрежни уреди. Безбедност и управување. Механизми за контрола на пристап. Алатки за инфраструктурно управување.',
        'Need and tasks of infrastructure management. Standard architecture for management (IT Management Architecture). Management of Internet network infrastructure, system infrastructure, storage infrastructure. Relationships of categories and mutual influences. Programmatic control of quality of service. Use of standard management protocols, higher level organization practices, ITIL, resource sharing. Performance Management: Latency and Capacity. Software for managing and controlling networks and network devices. Security and management. Access control mechanisms. Infrastructure management tools.',
