        'Business design thinking е пристап за решавање на проблеми во организации со фокус на постојан раст, развој, одржливост и иновации. Дизајн на продукти вклучително и ИТ системи е само еден од домените на примена на оваа методологија, која подеднакво успешно се применува во дизајн на услуги, стратегии, социјални системи и бизнис организации од било која сфера и област. Во основа на пристапот е брзо учење, генерирање идеи и ефикасна комуникација и соработка на ниво на организација со активно учество на корисниците (кодизајн). Во рамки на предметот студентите ќе стекнат знаења и hands-on искуство за основни елементи на теорија на дизајн:  генерирање на идеја, брз развој на прототип, тестирање и евалуација.  Во рамки на предметот ќе се обработуваат студии на случај за иновативни решенија како двигател на постојан раст, справување со комплексни проблеми и донесување одлуки во услови на непредвидливост и несигурност.',
        'Business Design Thinking is an approach to solving problems in organizations with a focus on constant growth, development, sustainability and innovation. Product design, including IT systems, is just one of the domains of applying this methodology, which is equally successfully applied in the design of services, strategies, social systems and business organizations in any sphere and area. At the basis of access is fast learning, generating ideas and efficient communication and cooperation at the organization level with active participation of users (codesin). Within the subject, students will gain knowledge and hands-on experience for basic elements of design theory: generating idea, rapid development of prototype, testing and evaluation. The case will be processed case studies for innovative solutions such as the driver of constant growth, dealing with complex problems and decision making in conditions of unpredictability and uncertainty.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
