       ('m23_w_063', '2929', 'Database management', '600', '9', '2', '2023', 'македонски, англиски', 'Теми обработени во рамките на овој предмет:
- Современи системи за управување со бази на податоци.
- Процес на моделирање на податоци и неговото значење за успешен развој и имплементација на информациските системи;
- Објектно-ориентирани модели, релациски модели, мрежни модели, граф-ориентирани модели и други модели.
- SQL – јазик и стандард за работа со релациски бази на податоци.
- Архитектура на бизнис информациските системи и значењето на базите на податоци во тие системи; дистрибуирани системи и дистрибуирани бази на податоци.
- Податочна сигурност кај системите за бази на податоци; трансакциско процесирање и конкурентност кај бази на податоци.
- Податочна доверливост кај системите на бази на податоци - бекап и обновување;
- Аналитички извештаи и поддршка за стратешко управување и планирање; податочни модели за анализа на податоци; мултидимензионална анализа над податоците и OLAP
- Преглед на најважните карактеристики на системите за управување со бази на податоци; специфични функционалности и проширувања.
- Преглед на најважните комерцијални и слободни системи за управување со бази на податоци.
- Критериуми за избор на системи за управување со бази на податоци во компаниите.', 'Topics processed within this subject:
- Contemporary database management systems.
- Data modeling process and its importance for successful development and implementation of information systems;
-Object-oriented models, relational models, network models, graph-oriented models and other models.
- SQL - language and standard for working with relational databases.
- Architecture of Business Information Systems and the importance of databases in those systems; Distributed systems and distributed databases.
- data reliability in database systems; transaction processing and competitiveness in databases.
- data confidentiality in database systems - backup and recovery;
- analytical reports and support for strategic management and planning; data models for data analysis; Multidimensional analysis over data and olap
- Overview of the most important features of database management systems; Specific functionalities and extensions.
- Overview of the most important commercial and free database management systems.
- Criteria for selecting database management systems in companies.', 'Целта на курсот е да го запознае студентот со областа на бази на податоци и информациските системи и да го обучи да води проекти за развој на бази на податоци, како и да го води одржувањето на постојните решенија со бази на податоци.

