        'Вовед - основни концепти и историски осврт. Дефиниција на молекуларната биологија. Кус историски осврт. Централна догма на молекуларната биологија. DNA молекулите како носители на генетските информации; експериментот на Евери; експериментот на Хиршеј и Чејс. Основни карактеристики на наследниот материјал; структура на DNA; Вотсон-Криков модел за структурата на DNA молекулот; структурна организација на DNA молекулот во хромозомите; суперспирализирана структура на циркуларните DNA молекули; нуклеозомална организација на DNA кај екариотите. Репликација на DNA; експериментот на Мезелсон и Стал; DNA полимерази; иницирање на репликацијата; репликациска вилушка; елонгација; реплизом - молекуларна машина за DNA репликација; специфики на DNA репликацијата кај еукариотите; репликациски проблем со теломерните краеви; терминирање на DNA репликацијата. Транскрипција - синтеза на RNA по урнек на DNA. Структура и функција на RNA молекулите. Транскрипција кај прокариотите; инцицијација на транскрипцијата, елонгација на транскрипцијата и терминацијата на транскрипцијата кај E. coli. Транскрипција кај еукариотите. Посттранскрипциски модификации; процесирање на 5` и 3` краевите на примарниот транскрипт од протеин-кодирачките гени. RNA сплајсинг - прекројување на примарниот RNA транскрипт; алтернативен сплајсинг. Транслација - синтеза на протеини. Генетски код. Транспортна RNA; поврзување на аминокиселините со tRNA. Рибозомите како транслациска машинерија. Процес на транслација; иницијација, елонгација и терминација на транслацијата. Протеини - номенклатура, големина на протеинските молекули. Нивоа на протеинската структура - примарна, секундарна, терциерна и кватерна структура. Структурна класификација на протеините. Примери на глобуларни, фибриларни и мембрански протеини. Регулација на транслацијата; посттранслациски случувања. Посттранслациска модификација на протеините.',
        'Introduction - basic concepts and historical review. Definition of molecular biology. A short historical review. Central dogma of molecular biology. DNA molecules as carriers of genetic information; EMERI`s experiment; The experiment of Hirschi and Chase. Basic characteristics of hereditary material; DNA structure; Watson-Krikov model for the structure of the DNA molecule; structural organization of the DNA molecule in chromosomes; superspiralized structure of circular DNA molecules; Nucleosomal organization of DNA at Eckaryot. DNA replication; Mezelson and Stal`s experiment; DNA polymerases; initiating replication; replication fork; elongation; Replisome - a molecular machine for DNA replication; specifics of DNA replication in eukaryotes; replication problem with telomeric ends; Terminating DNA replication. Transcription - Synthesis of RNA after DNA template. Structure and function of RNA molecules. Transcription of the prokaryotes; Incification of transcription, transcriptional and transcription termination of E. coli. Transcription in eukaryotes. Post -transcripial modifications; Processing 5 and 3 ends of the primary transcript of protein coding genes. RNA SPOSING - Recreation of the primary RNA transcript; Alternative clamping. Translation - protein synthesis. Genetic code. RNA transport; Connecting the amino acids to TRNA. Ribosomes like transsuitant machinery. Translation process; Initiation, elongation and transitional termination. Protein - nomenclature, size of protein molecules. Protein structure levels - primary, secondary, tertiary and quaternary structure. Structural classification of protein. Examples of globular, fibrillary and membrane protein. Transitional regulation; Post -transverse events. Post -radiation modification of protein.',
