1. Advanced System Skills for Different Interdisciplinary Studies (Linux)
2. Introduction to r
3. Introduction to Python
4. Pre -processing and cleaning data
5. Methods for visualizing data', 'Овој курс првенствено ќе се фокусира на развој на вештини потребни за поддршка на останатите курсеви во програмата. Додека го изучуваат овој курс, студентите ќе развијат систематско разбирање на принципите на компјутерската наука и науката за податоци, кои се во темелите на многу интердисциплинарни програми. На студентите ќе им се понуди широко знаење во клучните области на компјутерски науки релевантни за современите истражувања, вклучувајќи ја и способноста да се евалуираат податоци и да се идентификуваат соодветни алатки за нивно испитување и манипулација. Со овој курс студентите ќе се здобијат со следните компетенции:
