       ('IS-Z-01', '1690', 'Modeling and fusing unstructured data', '600', '9', '2', '2023', 'македонски и англиски', '1. Дефиниција и основи на податочна фузија, информациска фузија, сензорска/мултисензорска фузија. Класификација според релацијата на изворите, според нивото на апстракција и според релацијата влез-излез.
