5. Моделирање на неструктурирани податоци. Преглед и споредба на постоечки податочни модели и алгоритми за ефикасно чување, пребарување, пренос и приказ на податоците. Дизајн на релевантни апстрактни типови на податоци и нивна интеграција во постоечките јазици за моделирање.  Методи за квантифицирање на квалитетот на податочните модели.
6. Извлекување на релевантни информации од неструктурираните податоци. Лексикони и онтологии за претставување на здраворазумско знаење. Интегрирање на онтологии.', '1. Definition and bases of data fusion, information fusion, sensor/multisensory fusion. Classification according to the relation of sources, according to the level of abstraction and according to the relation-exit.
2. Methods, Techs and Data Fusion algorithms. Decision -making techniques. Assessment techniques. Maps of features. Sensor abstractions. Compression. Access from information theory.
