6. Extracting relevant information from unstructured data. Lexicones and ontologies for presenting mallerazian knowledge. Integrating ontologies.',
        'Во овој курс студентите ќе се запознаат со податочната фузија од аспект на информациска, сензорска и мултисензорска фузија. Тие ќе се оспособат за користење на методите, техниките и алгоритмите за податочна фузија. Ќе знаат да ги применуваат различните архитектури и модели за фузија на податоци. Различните типови на податоци што би се добивале преку фузија на изворите ќе треба да се моделираат според потребите. За таа цел студентите ќе треба да бидат оспособени за моделирање и репрезентација на неструктурирани податоци, методите и стратегиите за извлекување на информации од неструктурирани податоци, како и техниките за претставување на извлеченото знаење од податоците.',
        'In this course students will be introduced to the data fusion in terms of information, sensor and multisensory fusion. They will be able to use the methods, techniques and algorithms for data fusion. They will know how to apply different architectures and patterns for data fusion. The different types of data that would be obtained through fusion of sources will need to be modeled according to needs. To this end, students will need to be capable of modeling and representing unstructured data, methods and strategies for extracting information from unstructured data, as well as the techniques for presenting the knowledge extracted from the data.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби
