       ('IS-Z-03', '1699', 'Modern intelligent systems', '600', '9', '2', '2023', 'македонски и англиски',
        'Историски преглед на развојот на интелигентните системи. Проблеми и нивно решавање. Модерни системи за знаење и резонирање. Резонирање со концепт за можност и веројатност. Современи игри. Интелигентни системи за препознавање говор и слика. Архитектури на интелигенција. Длабоко учење. Роботски интелигентни системи. Паметни околини. ИКТ легислативи, регулативи и кибер закони за интелигентните системи. Предизвици и идни трендови кај ИС.',
        'A historical overview of the development of intelligent systems. Problems and their solution. Modern knowledge and reasoning systems. Reasoning with the concept of possibility and probability. Modern games. Intelligent speech and image recognition systems. Architectures of intelligence. Deep learning. Robotic Intelligent Systems. Smart environments. ICT legislation, regulations and cyber laws for intelligent systems. Challenges and future trends in IS.',
        'Цел на овој курс е студентот да добие перспектива за интелигентните системи и нивното влијание врз процесите во индустријата, здравството, образованието и науката. Студентите ќе ги научат современите примени и текови во развојот на интелигентните системи, како што се препознавањето на лица и предмети, автономни возила, машини кои резонираат слично како човекот, паметни околини во време на интернет на нештата итн. Студентите ќе се запознаат со разноликоста на современите интелигентни системи, кои имаат способност за извлекување и зачувување на знаење. Тие ќе ги научат резонирачките процеси кои се појавуваат кај овие системи. Ќе се оспособат да ги употребуваат интелигентните системи кои учат од нивното искуство и тренирање, способни се да се справат со непрецизни изрази и факти и изнаоѓаат решенија низ процеси кои се слични на природната еволуција. Технологиите и алгоритмите кои го овозможуваат тоа се исто така цел на овој курс.',
        'The aim of this course is for the student to gain a perspective on intelligent systems and their impact on processes in industry, healthcare, education and science. Students will learn the modern applications and trends in the development of intelligent systems, such as recognition of persons and objects, autonomous vehicles, machines that resonate like humans, smart environments in the age of the Internet of Things, etc. The students will get acquainted with the diversity of modern intelligent systems, which have the ability to extract and preserve knowledge. They will learn the reasoning processes that occur in these systems. They will be able to use intelligent systems that learn from their experience and training, are able to deal with imprecise expressions and facts, and find solutions through processes that are similar to natural evolution. The technologies and algorithms that make this possible are also the goal of this course.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби
