       ('IT-Z-01', '1807', 'Cyber threats analysis', '600', '9', '2', '2023', 'македонски и англиски',
        'Разбирање на анализата на закани. Традиционален животен циклус и структурирани аналитички техники. SIEM. Дефинирање на закани, разбирање на поврзаните ризици. Методи за детекција на закани. Конзумација на информации за закани за различни цели. Градење на тим за анализа на сајбер закани, планирање, насочување, развој на барања и цели. Kill chain модел. Дијамант модел. Извори за собирање информации:: домени, надворешни податочни множества, TLS/SSL сертификати, open source intelligence. Зачувување и структурирање на податоците. Структурирани техники за анализа. Истражување на хипотези. Градење кампањи. Тактичка и оперативна дисеминација. Стандардни технологии за анализа на сајбер закани (пр., CIF сервери, TAXII сервери, SIEM и други). Откривање на виновникот.',
        'Understanding threat analysis. Traditional life cycle and structured analytical techniques. SIEM. Defining threats, understanding the associated risks. Threat detection methods. Consumption of threat information for various purposes. Building a team for cyber threat analysis, planning, directing, developing requirements and objectives. Kill chain model. Diamond model. Information collection sources:: domains, external datasets, TLS/SSL certificates, open source intelligence. Data storage and structuring. Structured analysis techniques. Hypothesis research. Building campaigns. Tactical and operational dissemination. Standard technologies for cyber threat analysis (eg, CIF servers, TAXII servers, SIEM`s and others). Uncovering the culprit.',
        'Курсот ќе им овозможи на студентите да се запознаат со фундаменталните концепти и алатки на модерната анализа на сајбер закани. Студентите ќе се здобијат со знаења за животниот циклус на анализата на сајбер закани, идентификацијата, собирањето и интеграцијата на информации за закани и формати на запишување на информацијата.',
        'The course will enable students to become familiar with the fundamental concepts and tools of modern cyber threat analysis. Students will gain knowledge of the life cycle of cyber threat analysis, the identification, collection and integration of threat information and information recording formats.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости
предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
