        'Current trends in web application development platforms. Progressive web applications: rich offline experience, background synchronization, push notifications, service worker. Using the Web App Manifest. HTTPS/2/3 protocol: data compression, server push, request pipeline. Publish–subscribe pattern. Advanced Javascript: typed fields, binary data, web components, custom HTML elements. Advanced mobile application development. Extending the user experience. Development of small and sensitive applications. Adding advanced location features. Integration of sensor information.',
        'Предметот има за цел да го оспособи студентот за развивање на напредни мобилни и веб апликации кои ќе содржат напредни сервиси, зголемена интерактивност со корисниците и околината, подобри перформанси, скалабилност и безбедност.',
        'The course aims to enable the student to develop advanced mobile and web applications that will provide advanced services, increased interactivity with users and the environment, better performance, scalability and security.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '45', '15', '30', '50', '40',
        '180', '45', '50', '0', '10'),
       ('IT-Z-03', '1662', 'Network science', '600', '9', '2', '2023', 'македонски и англиски',
        'Својства на реалните масивни мрежи од различен вид и напредни модели за нивна репрезентација. Робустност и кршлавост на комуникациските мрежи, мрежите за храна и финансиските пазари. Генерална анализа на тополошките влијанија врз работата на комуникациските мрежи и детална анализа на Интернет и WWW. Ширење на информации, влијанија, идеи, падови и зарази во социјални и комуникациски мрежи. Извлекување знаење од големи мрежи, како класификација на јазли, предвидување на линкови и детекција на заедници. Репрезентативно учење во графови, ембедирање на јазли, линкови и цели графови, како и примена на граф невронски мрежи. Графови на знаење и повеќеслојни комплексни мрежи. Идентификација на функционални модули во биолошките мрежи. Временска анализа на комплексни мрежи.',
        'Properties of real massive networks of different types and advanced models for their representation. Robustness and fragility of communication networks, food webs and financial markets. General analysis of topological influences on the operation of communication networks and detailed analysis of the Internet and WWW. Spread of information, influences, ideas, crashes and contagions in social and communication networks. Knowledge extraction from large networks, such as node classification, link prediction and community detection, and application of graph neural networks. Representational learning in graphs: embedding nodes, links and whole graphs. Knowledge graphs and multi-layer complex networks. Identification of functional modules in biological networks. Temporal analysis of complex networks.',
