Dealing with missing data.
Predictive analytics guided by data.
Selection of appropriate machine learning techniques for an initial research study with data available.
Practical application of machine learning for prediction.
Dealing with dimensionality and optimization of predictive models.
Developing a simple predictive model with real data and data sets for testing hypotheses, data templates and predictive analysis.', 'Водечки компании како што се: Google, Facebook, и Netflix  користат предиктивна аналитика за развојот на своите продукти и сервиси. Во фокус на предметот се 1) аспектите од процесот на истражувачка анализа на податоци за и 2) изработка на едноставни предиктивни модели за откривање, разбирање и подлабок увид во информациите кои може да се извлечат од податоците. Студентите ќе се запознаат со техники за разбирање и сумирање на податоци, да комбинираат повеќе извори на податоци, да одлучат како да ги откријат шаблоните присутни во податоците за да ја поедностават понатамошната анализа при развојот на посложените статистички модели.
Дел од предметот опфаќа практична примена на научените техники во спроведување на истражувачка анализа на податоците и изработка на предиктивен модел за првичен увид во знаењето присутно во податоците.', 'Leading companies such as: Google, Facebook, and Netflix use predictive analytics to develop their products and services. The focus of the subject are 1) aspects of the process of research analysis of data for and 2) making simple predictive models for detection, understanding and deeper insight into the information that can be extracted from the data. Students will get acquainted with techniques for understanding and summarizing data, combining multiple data sources, deciding how to discover the templates present in the data to simplify further analysis in the development of more complex statistical models.
