       ('SDP-I-13', '0', 'Topological Data Analysis', '600', '9', '2', '2023', 'македонски', '1.	Вовед во основни поими од топологија: симплицијални комплекси, симплицијална хомологија, кубни комплекси, перзистентна хомологија,Чех комплекси, Виеторис-Рипс комплекси, CW комплекси, филтрaција.
2.	Осврт кон дигитална обработка на слики: перзистентни баркодови, перзистентни дијаграми, перзистентни слики, перзистентна хомологија на слики.
3.	Експерименти за примена на методи од ТДА врз синтетички генерирани и реални податочни множества од области на економија, медицина, генетика, обработка на слики и др. со софтверски алатки од Python, R и други програмски јазици.', '1. Introduction to basic terms of topology: simplicial complexes, simplicial homology, cubic complexes, persistent homology, Cech complexes, Vietoris-Ripps complexes, CW complexes, filter.
2. Review of digital image processing: persistent barcodes, persistent diagrams, persistent images, persistent image homology.
3. Experiments on the application of TDA methods on synthetically generated and realistic data sets of areas of economics, medicine, genetics, image processing and more. With software tools from Python, R and other programming languages.', 'Изучувањето на материјалот во овој курс има две цели: првата, да се даде вовед во оваа релативно нова област преку опишување на методите коишто се користат и нивните математички основи во алгебарската топологија.
Втората цел е да се применат методи од ТДА во обработка на реални податочни множества, на пример: во процес на класификација и машинско учење, и да се испита дали примената ќе резултира со подобрување на перформансите при класификација наспроти модели, кои што не ги вклучуваат овие тополошки карактеристики.', 'The study of the material in this course has two goals: the first, to give an introduction to this relatively new area by describing the methods used and their mathematical bases in algebraic topology.
The second goal is to apply TDA methods in processing real data sets, for example: in the process of classification and machine learning, and to investigate whether application will result in improved classification performance versus models that do not include these topological features.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби
