       ('SI-Z-01', '628', 'Software Lifecycle Management', '600', '9', '2', '2023', 'македонски и англиски',
        'Животен циклус на софтверот, методологии и техники. Агилни методи за развој на софтвер. Менаџирање на барања. Методи за системски и детален дизајн. Планирање и менаџирање на процесот на развој на софтвер. Менаџирање на софтверски проекти, управување со ресурси, контрола на ризици. Контрола на квалитетот преку ревизии и тестирање. Стратегии за испорачување. Менаџирање на конфигурации и промени. Одржување на софтвер, испорака на IT сервси и релации со клиенти. Специфики при развој на веб базиран софтвер и софтвер за дистрибуирани и системи во облак. Софтвер за сервисно ориентирани системи. Софтвер за мобилни уреди и вградливи системи. Софтвер како услуга. Економски аспекти при развојот на софтвер. Софтверски алатки за управување со животниот циклус на софтверот.',
        'Life cycle of software, methodologies and techniques. Agile software development methods. Requirements Management. Methods for systemic and detailed design. Planning and managing the software development process. Managing software projects, resource management, risk control. Quality control through audits and testing. Delivery Strategies. Managing configurations and changes. Maintaining software, delivery of IT servants and customer relationships. Specifics in the development of web -based software and software for distributed and cloud systems. Service software oriented systems. Software for mobile devices and built -in systems. Software as a service. Economic aspects of software development. Software management software tools.',
        'Целта на курсот е студентите да се здобијат со солидни знаења за софтверското инженерство при развојот на големи софтверски развојни проекти. По завршувањето на курсот кандидатите ќе можат: да специфицираат, моделираат, имплементираат и тестираат софтверски системи, да дефинираат, планираат и надгледуваат проект за развој и одржување на сложени софтверски системи, работејќи во тим, да соработуваат со други тимови при работа на заеднички проект, ќе можат да извлечат, анализираат и документираат искуства од развојните проекти на софтверски и софтверско интензивни системи, да владеат со генералните принципи и техники за контрола на квалитетот на софтверскиот систем како сигурност, безбедност, доверливост карактеристични за различни видови на софтверски системи.',
        'The purpose of the course is for students to acquire solid knowledge of software engineering in the development of large software development projects. Upon completion of the course, candidates will be able to: specify, model, implement and test software systems, define, plan and supervise a project for development and maintenance of complex software systems, working in a team, to collaborate with other teams when working on a joint project, They will be able to extract, analyze and document experiences from developing software and software intensive systems, to rule the general principles and techniques for controlling the quality of the software system as security, security, confidentiality characteristic of different types of software systems.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '60', '0', '45', '45', '30',
        '180', '35', '45', '0', '0'),
       ('SI-Z-03', '629', 'Software Design Patterns', '600', '9', '2', '2023', 'македонски и англиски',
        'Дизајн на софтвер, шаблони за дизајн - дефиниција, историја, Observer Pattern, Template Method Pattern, Factory Patterns: Factory Method and Abstract Factory, Singleton Pattern, Facade Pattern, Visitor Pattern, Functors and the Command Pattern, Iterator Pattern, Composite Pattern, State and Strategy Patterns, Adapter Pattern, Proxy Pattern, Decorator Pattern, Chain of Responsibility Pattern, Concurrency Patterns, AntiPatterns, шаблони за имплементација, моделирање на улоги, композитни шаблони за дизајн, формални методи и шаблони за дизајн.',
        'Design software, Design templates - Definition, History, Observer Pattern, Factory Patterns: Factory Method and Abstract Factory, Singleton Pattern, Facade Pattern, Visitor Pattern, Functors and the Command Pattern, Iterator Pattern, Composite Pattern, State And Strategy Patterns, Adapter Pattern, Proxy Pattern, Decorator Pattern, Chain of Responsibility Pattern, Concurrency Patterns, Antipatterns, Implementation stencils, Rolling templates, composite design templates, formal methods and design templates.',
        'Целта на курсот е студентите да добијат познавања за шаблоните за развој на софтвер, стандардните решенија на стандардни проблеми при дизајнирањето на софтвер, да се запознаат со механизмите на еволуција на софтвер, рефакторизацијата како и со имплементациски шаблони. По завршувањето на курсот кандидатите ќе можат: да ја разберат, согледаат потребата и да ги применат техниките за поврзување и кохезија на компонентите во објектно-ориентираниот дизајн, да ги опишат и успешно да ги применуваат најприменуваните програмски шаблони, да ги категоризираат програмските шаблони на основа на дизајнерскиот повод како интерфејсот, одговорноста, конструирањето, примената и проширувањето на шаблоните, да дизајнираат и конструираат големи рамковно ориентирани компјутерски системи со примена на мета-системски пристап на објектно-ориентираното програмирање, да дизајнираат и имплементираат шаблонска апликација со избор и примена на вистинските програмски шаблони.',
        'The purpose of the course is for students to get knowledge of software development templates, standard solutions to standard software design problems, to get acquainted with the mechanisms of software evolution, refactorization and implementation templates. Upon completion of the course, candidates will be able: to understand, perceive the need and apply the techniques for connecting and cohesion of components in object-oriented design, to describe and successfully apply the most used program templates, categorize the program templates on the basis The design occasion such as the interface, responsibility, constructing, applying and expanding templates, designing and constructing large framework-oriented computer systems by applying a meta-system access to object-oriented programming, designing and implementing a template Program templates.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'NULL', 'реализирани активности', '60', '0', '45', '45', '30',
        '180', '40', '45', '0', '0'),
       ('SNP-Z-2', '2900', 'Regression Models', '600', '9', '2', '2023', 'македонски', 'Линеарна регресија: оценување, заклучување, дијагностика, тестирање на хипотези.
Мултиномна регресија, Логистичка регресија, ординална, поасонова.
